(99, 'Sri Purwatik', '21110110120052', 'Analisis Ketersediaan Ruang Terbuka Hijau Berdasarkan Kebutuhan Oksigen (Studi Kasus : Kota Salatiga)', 'Bandi Sasmito, ST., MT', 'Ir. Hani\'ah', 'Kota Salatiga', '33.73', 'Karto SIG', 2014, '1. Citra Quickbird Kota Salatiga Tahun 2006\n2. Citra Resolusi Tinggi dari Google Earth Perekaman 5 Juni 2012\n3. Peta Administrasi dan Pola Ruang Kota Salatiga\n4. Peta Jaringan Jalan dan Sungai Kota Salatiga\n5. Data Jumlah Penduduk , Jumlah Ternak, dan Data Lalu Lintas Harian Rata-Rata Kota Salatiga', '1. Overlay\n2. Interpretasi Citra\n3. Digitasi', '1. Peta RTH Kota Salatiga\n2. Luasan RTH untuk Kebutuhan Oksigen', '1. Berdasarkan pengolahan citra resolusi tinggi Kota Salatiga tahun 2012, didapatkan luas Ruang Terbuka Hijau Kota Salatiga tahun 2012 sebesar 910,58 Ha atau sekitar 16,31% dari total luas wilayah yang terdiri dari 7,46% Ruang Terbuka Hijau privat dan 8,85% Ruang Terbuka Hijau Publik. Sehingga dapat disimpulkan bahwa luas Ruang Terbuka Hijau eksisting belum memenuhi jumlah yang ditentukan dalam RTRW Kota Salatiga sebesar 30% dari total luas wilayah yang terdiri dari 10% Ruang Terbuka Hijau Privat dan 20% Ruang Terbuka Hijau Publik.\n2. Berdasarkan jumlah penduduk dan kebutuhan oksigen, dapat disimpulkan :\na. Besaran Ruang Terbuka Hijau sebagai suatu fasilitas kebutuhan suatu kota harus diperhitungkan dengan standarisasi yang layak berdasarkan jumlah penduduk dengan segala aktivitasnya dan sesuai dengan fungsi dan manfaat yang dimiliki Ruang Terbuka Hijau. Berdasarkan jumlah penduduknya, Kota Salatiga memerlukan Ruang Terbuka Hijau sebesar 372,174 Ha. Sehingga dapat disimpulkan bahwa luas Ruang Terbuka Hijau yang ada sudah memenuhi yaitu sebesar 910, 58 Ha.\nb. Bila dilihat dari kebutuhan Ruang Terbuka Hijau berdasarkan Kebutuhan Oksigen, Kota Salatiga memerlukan Ruang Terbuka Hijau sebesar 3452,6515 Ha. Sehingga dengan luas RTH yang ada belum memenuhi. Namun, bila ditambah dengan vegetasi Non RTH penghasil oksigen, luas penghasil Oksigen menjadi 4912,79 Ha. Sehingga, dengan luas penghasil oksigen tersebut sudah memenuhi batas minimum suplai oksigen.', '1. Mengingat besarnya volume kendaraan bermotor di Kota Salatiga, maka perlu dilakukan studi untuk menurunkan tingkat pencemaran udara yang dihasilkan oleh kendaraan bermotor terutama yang terkait dengan keberadaan RTH.\n2. Memperbanyak jalur hijau, di lokasi-lokasi padat kendaraan bermotor.\n3. Penataan Kota perlu diperhatikan, dalam hal ini untuk penambahan Taman Kota.\n4. Pemerataan Ruang Terbuka Hijau di Kota Salatiga.\n5. Pengembangan RTH Privat, seperti Taman di pemukiman, dan daerah kantor.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/5844/5634', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
