(132, 'Bhekti Hapsari', 'L2M009042', 'Evaluasi Kesesuaian Lahan Tanaman Pertanian Berbasis Sistem Informasi Geografis Dengan Menggunakan Metode Fuzzy Set', 'Moehammad Awaludin,ST,MT', 'Bambang darmo Yuwono, ST.MT', 'Kab. Wonogiri', '33.12', 'Karto SIG', 2014, '1. Peta Administratif \n2. Peta Curah Hujan \n3. Peta Jenis Tanah \n4. Peta Kelerengan', 'Overlay peta, penentuan lokasi sampling, uji laboratorium, unit evaluasi, matching dengan menggunakan metode fuzzy set, dan pembuatan peta kesesuaian lahan untuk tanaman pertanian. ', 'Nilai ? LSI (Land Suitability Index) ini yang dijadikan acuan untuk penentuan kelas kesesuaian lahan pada 9 komoditas yang dikaji. ? LSI (Land Suitability Index) merupakan jumlah dari nilai MF parameter dikali dengan bobot. Untuk contoh perhitungan tersebut satuan lahan 1Di memiliki ? LSI 0.885495298, artinya adalah pada satuan lahan 1Di tingkat kesesuaian lahan untuk komoditas jagung memilki nilai indeks kesesuaian lahan sebesar 0.885495298. Pada tabel 2 di atas menunjukkan himpunan nilai ? LSI pada tiap-tiap komoditas pertanian.', '1. S1 (Sangat Sesuai) dengan indeks fuzzy set 0.8 - 1 untuk tanaman jagung sebanyak 86.67%, kacang tanah 100%, kedelai 100%, padi 93.33%, bawang putih 100%, cengkeh 80%, cokelat 86.67%, kelapa 100%, dan tebu 86.67% dari total luas kawasan pertanian di Kecamatan Eromoko. \n2. S2 (Cukup Sesuai) dengan indeks fuzzy set 0.6 ? 0.8 untuk tanaman jagung sebanyak 13.33%, padi 6.67%, cengkeh 20%, cokelat 13.33%, dan tebu 13.33% dari total luas kawasan pertanian di Kecamatan Eromoko.', 'Berdasarkan hasil penelitian berupa peta kesesuaian lahan pertanian dengan Indeks Kesesuaian Lahan dengan menggunakan metode fuzzy set dapat digunakan sebagai acuan untuk penentuan lokasi penanaman yang baik sehingga dapat dimanfaatkan petani atau pemerintah untuk mengetahui jenis perlakuan yang akan diberikan pada lahan tersebut. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/4726/4557', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
