(138, 'Handayani Nur Arifiyanti', 'L2M009062', 'Analisis Ruang Terbuka Hijau Kota Semarang Menggunakan Sistem Informasi Geografis di Kota Semarang', 'Moehammad Awaludin,ST,MT', 'LM Sabri,ST,MT', 'Kota Semarang', '33.74', 'Pertanahan Kewilayahan', 2014, '1. Citra Quickbird Kota Semarang Tahun 2010\n2. Peta Garis Kota Semarang\n3. Peta Permukiman Kota Semarang\n4. Data Taman Kota Semarang Tahun 2012', '1. Overlay\n2. Interpretasi Citra\n3. Digitasi', '1. Peta RTH Kota Semarang\n2. Kesesuaian RTH terhadap Perda\n3. Kapasitas Taman Aktif Per Jiwa', '1. Setelah memetakan ruang terbuka hijau didapatkan jumlah total ruang terbuka hijau yang dimiliki oleh Kota Semarang dan Kecamatanannya, namun banyaknya jumlah dari ruang terbuka hijau tidak merata seperti Kecamatan Gunung Pati dan Mijen terdapat banyak ruang terbuka hijau tetapi pada Kecamatan Semarang Barat, Semarang Selatan, Semarang Tengah, Semarang Timur, Semarang Utara dan Tugu sangat sedikit.\n2. Kota Semarang memiliki ruang terbuka hijau sebanyak 17.149,902 Ha yang terdiri dari hutan non produksi 68.152.865,51 m??, jalur hijau jalan 354.590,98 m, dan taman 268.143,41 m??, hutan produksi 23.347.152,35 m??, perkebunan 9.641.452,91 m?? pertanian 17.588.565,97m??, lapangan 882,102,36 m??, dan makam 1.289.692,49 m??. Dari jumlah tersebut didapatkan perbandingan antara ruang terbuka hijau public sebesar 20,88%, dan ruang terbuka hijau Private 16,01%, berarti sudah sesuai dengan peraturan yaitu 10% ruang terbuka hijau privat dan 20% ruang terbuka hijau publik.\n3. Kota Semarang memiliki taman aktif sebanyak 64, tetapi hanya 10 taman saja yang sesuai dan melebihi kapasitas yaitu 1,5 m?? per jiwa.', '1. Kota Semarang kebih memberikan persebaran ruang terbuka hijau yang merata kepada setiap kecamatannya, agar tidak terjadi kesenjangan pada setiap daerahnya.\n2. Kota Semarang harus dapat mempertahankan kesesuaian ruang terbuka hijau ini agar tidak terjadi pengurangan karena ruang terbuka hijau sangat penting untuk kehidupan masyarakat.\n3. Perlu penambahan taman dan persebaran yang merata.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/4730/4561', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
