(199, 'Bekti Noviana', '21110110120034', 'Analisis Kesesuaian Perubahan Penggunaan Tanah Terhadap Rencana Tata Ruang Wilayah Kota Salatiga (RTRW) Tahun 2003,2008 Dan 2013', 'Ir. Sawitri Subiyanto, M.Si', 'Bandi Sasmito, ST., MT.', 'Kota Salatiga', '33.73', 'Pertanahan Kewilayahan', 2015, '1. Peta RTRW kota Salatiga tahun1989-2006 dan 2010-2030 dari BAPPEDA Kota Salatiga \n2. Capture citra pada google earth \n3. Peta Penggunaan tanah tahun 2003, 2008 dan 2013 dari kantor Pertanahan Kota Salatiga \n4. NSPK BPN untuk klasifikasi penggunaan tanah skala 1 : 10000 dari Kantor Pertanahan Kota Salatiga 5. Peta administrasi wilayah dari BAPPEDA kota Salatiga ', 'Digitasi on screen dan overlay ', 'Analisis yang telah di lakukan diperoleh data bahwa penggunaan tanah yang benar benar sesuai dengan arahan fungsi kawasan dalam RTRW kota Salatiga masih menunjukkan angka tingkat kesesuaian yang jauh dari optimal (3266,59ha) atau sebesar (58,41%), sedang sisanya (2326,02ha) atau sebesar (41,59%) pada tahun 2008 dan (3315,92 ha) atau sebesar (59,39%), dan sisanya (2267.76) atau sebesar (40,61%) pada tahun 2013 menunjukkan bahwa hampir mendekati 50% dari luas wilayah Kota Salatiga penggunaan tanahnya tidak sesuai dengan arahan fungsi kawasan. Dengan melihat fakta tersebut, kiranya pemerintah kota Salatiga beserta dengan para Stakeholder dan segenap masyarakat harus bekerja keras secara sinergisa dan serius memperhatikan kondisi dimaksud untuk dapat mewujudkan penggunaan tanah yang sesuai dengan arahan fungsi kawasan .Hasil analisis kesesuaian penggunaan tanah terhadap arahan fungsi kawasan, apabila dilihat dari jesesuaianya perfungsi kawasan menunjukkan bahwa arahan Tempat Pembuangan Akhir (TPA) mempunyai tingkat kesesuaian penggunaan tanah tertinggi (100%) sesuai. Diikuti arahan pertanian lahan basah (93,64%) sesuai. Diikuti  arahan perkebunan (99,22%). Perkantoran (91,83%), sempadan sutet (85,88%). Pertanian lahan kering (89,49%) di tahun 2008. Sedangkkan pada arahan fungsi kawasan rencana tata ruang yang lainnya mempunyai tingkat kesesuaian yang lebih rendah. Masih sama dengan kesesuaian tahun 2008 di tahun 2013 TPA juga memiliki tingkat kesesuaian penggunaan tanah tertinggi yaitu (99,79%) diikuti penggunaan tanah pertanian lahan basah (81,07%). Pertanian lahan kering (89,49%) bedanya sedikit ada penurunan kesesuaian penggunaan tanah dimana sebelumnya pada tahun 2008 lebih tinggi di bandingkan pada tahun 2013. ', '1. Perubahan Penggunaan Tanah di wilayah Kota Salatiga dari tahun 2003 sampai 2013 di dominasi oleh perubahan penggunaan tanah pertanian menjadi tanah non pertanian. Perubahan menjadi tanah non pertanian antara lain sebagai pemukiman, fasilitas sosial, industri, kesehatan, perdagangan dan jasa, pendidikan, dan lainnya. Hal ini juga sesuai dengan arahan rencana tata ruang wilayah Kota salatiga yang memang lebih memfokuskan arahan perubahan penggunaan tanahnya dari tanah pertanian menuju tanah non pertanian. Kategori terbesar yang menggunakan perubahan penggunaan tanah yaitu pemukiman serta industri. \n2. Sebaran perubahan penggunaan tanah di Kota Salatiga sudah sesuai dengan arahan  rencana tata ruang wilayah Kota Salatiga, dimana perindustrian di fokuskan di wilayah kecamatan Argomulyo, kemudian perdagangan dan jasa serta perkantoran di Kecamatan Sidoreo dan Kecamatan Salatiga.untuk wilayah pemukiman tersebar di keempat kecamatan, namun dalam perkembangannya wilayah Kecamatan Argomulyo memiliki arahan pengembangan pemukiman yang terbesar. \n3. Kesesuaian penggunaan tanah terhadap RTRW di Kota Salatiga, bisa di katakan cukup sesuai, karena pada tahun 2008, dan 2013 sudah hampir 60% kesesuaian penggunaan tanahnya dengan RTRW sementara sisanya masih termasuk dalam kawasan pengembangan dimana nanti kedepannya akan di alih fungsikan sebagian penggunaan tanahnya. ', '1. Untuk penelitian selanjutnya sebaiknya menggunakan metode yang berbeda sehingga dapat di gunakan untuk membandingkan hasil yang di peroleh dalam penelitian ini. \n2. Hasil penyusunan analisis perubahan penggunaan tanah ini agar dapat bermanfaat sebagai referensi pengetahuan tentang perubahan penggunaan tanah di lingkungan Kota Salatiga. \n3. Dalam analisis yang telah di lakukan di ketahui tingkat kesesuaian penggunaan tanah kota salatiga dengan rencana tata ruang wilaiyah hanya sebesar 60%, sehingga untuk kedepannya sebaiknya pemerintah Kota Salatiga lebih memperhatikan kesesuaian penggunaan tanah. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/9912/9631', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
