(253, 'Togi Pardo Siagian', '21110111120007', 'Evaluasi Kriteria Kesesuaian lahan Dengan Analitical Hierarchy Process (Studi Kasus: Kecamatan, Boja, Kecamatan Limbangan) ', 'Ir. Bambang Sudarsono, MS', 'Arwan Putra Wijaya, ST., MT.', 'Kab. Kendal', '33.24', 'Karto SIG', 2016, '1. Peta Administrasi Kabupaten Kendal Tahun 2011 \n2. Peta Tata Guna Lahan Kabupaten Kendal tahun 2011 \n3. Peta Jenis Tanah Kabupaten Kendal tahun 2011 \n4. Citra Worldview terkoreksi Kabupaten Kendal 2014 \n5. Peta Jaringan Jalan utama Kabupaten Kendal 2011 \n6. Peta curah hujan Kabupaten Kendal Tahun 2011 \n7. Peta Gerakan Tanah Kabupaten Kendal 2011 \n8. Peta Kelerengan Kabupaten Kendal tahun 2011 \n9. Citra SAS Planet', 'Metode SIG  yaitu Pengolahan AHP', 'Pada jurnal penitian ini hasil penelitian ditulis dalam bentuk tabel dan tidak ada penjelasan dalam bentuk kalimat', '1. Berdasarkan hasil scoring dan pembobotan menggunakan metode AHP dari peta kemiringan lereng, gerakan tanah, jenis tanah, curah hujan, penggunaan lahan serta jarak terhadap jalan utama yang diperoleh dengan kesesuaian lahan pemukiman yang terdapat di kecamatan Limbangan,  dengan luas 2.213,26 (ha) untuk lahan sesuai (S2), 4.377,643 (ha) untuk lahan cukup sesuai (S3), 1.648,422 (ha) untuk kelas lahan kurang sesuai (N1) serta untuk lahan tidak sesuai (N2) memiliki lahan seluas 171,99 (ha). Untuk kecamatan Boja, diperoleh 194,57 (ha) untuk lahan kelas sangat sesuai (S2), dan 3.779,58 (ha) untuk lahan Sesuai (S1), 1.945,98  (ha) untuk lahan cukup sesuai (S3), 1,5 (ha) untuk kelas lahan kurang sesuai (N1) serta untuk lahan tidak sesuai (N2) memiliki lahan seluas 9,79 (ha).  2. Berdasarkan analisa kesesuaian lahan dengan kondisi tutupan lahan saat ini di kabupaten Kendal untuk kecamatan Limbangan lahan sebesar 26,33% sesuai,  lahan sebesar 52,04% \ncukup sesuai, dan ada sekitar 19,59% lahan kurang sesuai serta 2,04% lahan sama sekali tidak sesuai. 3. Berdasarkan analisa kesesuaian lahan dengan kondisi tutupan lahan saat ini di kabupaten Kendal untuk kecamatan Boja lahan sebesar 3,28% sangat sesuai, lahan sebesar 63,72% sesuai, lahan sebesar 32,81% cukup sesuai, dan ada sekitar 0,03% lahan kurang sesuai serta 0,16% lahan sama sekali tidak sesuai. ', '1. Diperlukannya keterlibatan dan kerja sama antar instansi, baik instansi pemerintah maupun swasta dalam hal mewujudkan terlaksananya optimalisasi dibidang pembangunan dan pengembangan lahan pemukiman guna mewujudkan terlaksananya Pembangunan secara keseluruhan yang efektif dan efisien. \n2. Tiap instansi-instansi diharapkan mempunyai serta melengkapi file softcopy maupun hardcopy peta-peta di Kendal  sebagai inventaris daerah sesuai dengan bidang pekerjaan dari tiap instansi tersebut. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/10563/10255', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
