(257, 'Sindy Pariamanda', '21110111120015', 'Analisis Kesesuaian Lahan Perkebunan Kopi di Kabupaten Semarang', 'Abdi Sukmono, ST., MT', 'Ir. Hani\'ah, M.Si', 'Kab. Semarang', '33.22', 'Pertanahan Kewilayahan', 2016, '1. Peta administrasi Kabupaten Semarang Tahun 2011 \n2. Peta tata guna lahan Kabupaten Semarang tahun 2011 \n3. Data ASTER GDEM Kabupaten Semarang tahun 2011 \n4. Data curah hujan Kabupaten Semarang tahun 2009-2014 \n5. Data jumlah bulan kering Kabupaten Semarang tahun 2009-2014 \n6. Data suhu udara rata-rata Kabupaten Semarang tahun 2014', 'Metode matching dan metode AHP', 'Jika dilihat berdasarkan metode yang digunakan, hasil dengan metode AHP lebih mendekati pada arah kelas yang lebih sesuai. Hal ini dilihat dari total kesesuaian lahan kopi arabika berdasarkan metode AHP yang sesuai yaitu kelas S1, \nS2 dan S3 sebesar 99,99% atau selisih 10,3% dengan metode matching.  Hasil tersebut di atas sebanding dengan yang diperlihatkan pada hasil kesesuaian lahan untuk kopi robusta. Pada kopi ini, perbedaan metode matching dengan AHP sangat terlihat jelas, dimana pada metode matching terbentuk kelas S1 hanya sebesar 0,46%, kelas S2 sebanyak 63,78%, kelas S3 34,25% dan kelas N sebanyak 1,51%. Sementara pada metode AHP kelas kesesuaian lahan yang terbentuk adalah kelas S1 mencapai 71,32%, kelas S2 28,66% dan kelas S3 0,02%. Pada metode AHP ini, tidak ada kelas N yang terbentuk sehingga bila ditotal, kelas sesuai (S1, S2 dan S3) yang dihasilkan adalah 100%. ', '1. Berdasarkan metode matching kesesuaian lahan kopi arabika yang terbentuk adalah seluas 46.938,81 Ha sesuai marginal (S3) dan 5.387,25 Ha tidak sesuai (N). Kesesuaian untuk kopi robusta adalah seluas 238,11 Ha sangat sesuai (S1), 33.372,84 Ha cukup sesuai (S2), 17.920,25 Ha sesuai marginal (S3) dan 790,81 Ha tidak sesuai (N). Sementara untuk metode AHP didapat hasil kesesuaian lahan kopi arabika seluas 14.089,93 Ha sangat sesuai (S1), 34.167,95 Ha cukup sesuai (S2), 4.062,13 Ha sesuai marginal (S3), dan 6,35 Ha tidak sesuai (N). Kesesuaian lahan kopi robusta seluas 37.211,36 Ha sangat sesuai (S1), 14.994,20 Ha cukup sesuai (S2) dan 8,28 Ha sesuai marginal (S3). \n2. Perbedaan metode matching dan metode AHP terletak pada penentuan akhir kelas kesesuaian suatu lahan. Pada metode matching digunakan faktor pemberat sebagai penentu akhir kelas kesesuaian suatu lahan dimana jika sudah ada satu parameter dengan kelas terendah maka kelas parameter lain tidak berpengaruh lagi dalam penentuan kelas lahan. Sementara pada penetuan kelas akhir dengan metode AHP, digunakan metode pembobotan setiap parameternya sehingga masing-masing parameter masih memiliki pengaruh dalam menetukan kelas kesesuaian suatu lahan. ', '1. Diperlukan penggunaan parameterparameter lain seperti  pada pedoman kriteria kesesuaian lahan kopi berdasarkan FAO agar hasil kesesuaian lahan lebih mendekati kondisi sebenarnya di lapangan. \n2. Ketersediaan data yang lebih lengkap mengenai kondisi topografi, iklim, jenis tanah dan kondisi alam lainnya agar tidak ada parameter yang terpengaruh parameter lain.  \n3. Diperlukan penggunaan citra satelit untuk mengetahui batas-batas perkebunan \nkopi dengan lebih jelas sebagai bahan analisis kesesuaian lahan perkebunan yang sudah ada dan referensi pengembangan perkebunan kopi di Kabupaten Semarang. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/10564/10256', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
