(276, 'Fauzi Iskandar', '21110110110019', 'Analisis Kesesuaian Penggunaan Dan Pemanfaatan Lahan Terhadap Rencana Tata Ruang / Wilayah di Kecamatan Kutoarjo Menggunakan Sistem Informasi Geografis', 'Moehammad Awaluddin, S.T., M.T', 'Bambang Darmo Yuwono, ST., MT', 'Kab. Purworejo', '33.06', 'Pertanahan Kewilayahan', 2016, '1. Peta Pola Ruang (Rencana Tata Ruang Ruang / Wilayah) \n2. Batas Administrasi Kecamatan Kutoarjo\n3. Citra Satelit QuickBird 2014\n', 'Digitasi dan overlay ', 'Pemanfaatan lahan dengan luas total 3920,73 hektar didominasi oleh pemanfaatan lahan untuk kegiatan ekonomi sebesar 55,047% atau seluas 2.158,24 hektar, pemanfaatan untuk tempat tinggal sebesar 35,048% atau seluas 1.374,14 hektar, pemanfaatan lahan untuk kegiatan sosial sebesar  4,689% atau 184,20 hektar dan tidak ada pemanfaatan sebesar 5,207% atau 204,15 hektar.  Tingkat kesesuaian paling tinggi terdapat di Desa Kiyangkorejo dengan presentase sebesar 98,70% dari luasan desa dan yang paling rendah terdapat di Desa Tursino dengan presentase 82,82% dari luasan desa dan rata-rata tingkat kesesuaian adalah 92,67%. Hasil untuk area kecamatan adalah 92,35% sesuai dan 7,65% tidak sesuai. ', '1. Penggunaan lahan di Kecamatan Kutoarjo Lahan dengan luas total 3920,73 hektar didominasi oleh sawah sebesar 46,167% atau seluas 1810,10 hektar, dan kampung jarang kampung jarang sebesar 28,289% atau seluas 1109,14 hektar. \n2. Pemanfaatan lahan di Kecamatan Kutoarjo didominasi oleh pemanfaatan lahan untuk kegiatan ekonomi sebesar 55,047% atau seluas 2.158,24 hektar, pemanfaatan untuk tempat tinggal sebesar 35,048% atau seluas 1.374,14 hektar, pemanfaatan lahan untuk kegiatan sosial sebesar  4,689% atau 184,20 hektar dan tidak ada pemanfaatan sebesar 5,207% atau 204,15 hektar. 3. Hasil dari kesesuaian lahan didapatkan luasan sebesar 3.620,782 hektar atau 92,35% dari luasan kecamatan penggunaan lahannya sesuai dengan apa yang direncanakan, sementara seluas 299,995 hektar atau 7,65% dari luasan kecamatan penggunaan lahannya tidak sesuai dengan perencanaannya. ', '1. Survei lapangan sebaiknya dilakukan lebih merata ke lebih banyak area penelitian \n2. Pengambilan data titik sampel dalam penentuan klasifikasi sebaiknya diperbanyak lagi agar hasil klasifikasi yang didapatkan lebih detail. \n3. Pengolahan kesesuaian sebaiknya dilakukan dengan mengacu pada satuan bidang tanah agar  diperoleh akurasi luasan kesesuaian yang lebih tinggi.  ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/10551/10243', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(277, 'Leur P.M Sitorus', '21110111190071', 'Pembuatan Peta Zona Nilai Tanah Berdasarkan Harga Pasar Dengan Metode Pendekatan Penilaian Massal di Kecamatan Mijen Kota Semarang', 'Ir. Sawitri Subiyanto, M.Si', 'Bambang Darmo Yuwono, ST., MT', 'Kota Semarang', '33.74', 'Pertanahan Kewilayahan', 2016, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/10607/10296', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(278, 'Setyo Adhi Nugroho', '21110111140073', 'Analisis Pengaruh Perubahan Vegetasi Terhadap Suhu Permukaan di Wilayah Kabupaten Semarang Menggunakan Metode Penginderaan Jauh', 'Arwan Putra Wijaya, ST., MT', 'Abdi Sukmono, ST., MT', 'Kab. Semarang', '33.22', 'Fotri Inderaja', 2016, '1. Citra Satelit Landsat 5 tahun 1997, Citra Satelit Landsat 7 tahun 2002, Citra Satelit Landsat 8 tahun 2013 dan 2015, Citra DEM SRTM tahun 2014 \n2. Peta RBI Tutupan lahan Kabupaten Semarang Skala 1:25.000 \n3. Peta Batas Administrasi Kabupaten Semarang. ', 'Algoritma NDVI dan algoritma Mono-window Brightness Temperatur', 'Nilai mean dari suhu permukaan tahun 2013 dengan tahun 2015 adalah sebesar -2,53 sedangkan untuk NDVI sebesar 0,00 dengan standar deviasi sebesar 0,13 dan hasil korelasi NDVI dengan suhu permukaan memiliki nilai korelasi -0,39 atau  39 % yang berarti korelasi antara dua avriabel yaitu suhu dan ndvi berjalan dengan arah yang berlawanan, bertententangan, artinya pada dua variabel ini yaitu variabel ndvi dan suhu permukaan pengaruh perubahannya sebesar 39 %.  hasil ekstraksi suhu dari citra landsat tahun 2013 dan citra DEM SRTM didapatkan selisih untuk kelas yang pertama yaitu kelas 8?-10? mempunyai selisih luas sebesar 104,43 hektar dan nilai persentase 100 %. Kelas berikutnya 11?-13? mempunyai selisih sebesar 319,51 hektar dan nilai persentase 100 %. Kelas selanjutnya 14?-16? mempunyai selisih luas sebesar 674,48 hektar dan nilai persentase 100 %. Kelas 17?-19? mempunyai selisih luas sebesar 3867,61 hektar dan nilai prsentase 97 %. Kelas 20?-22? mempunyai selisih luas sebesar 15053,16 hektar dan nilai persentase 95 %. Kelas berikutnya 23?-25? mempunyai selisih luas sebesar 66016,16 hektar dan nilai persentase 96 %. Selanjutnya kelas 26?-28? mempunyai selisih luas sebesar 3585,07 hektar dan nilai persentase 16 %. Selisih suhu rata-rata antara hasil ekstraksi suhu dari citra landsat dengan hasil ekstraksi suhu dari citra DEM SRTM memiliki nilai selisih sebesar 5,52?C. ', '1. Kelas suhu permukaan pada tahun 1997 yang mendominasi adalah kelas 29?C-31?C, namun bertambahnya luas lahan terbangun mempengaruhi distribusi suhu permukaan, yang mengakibatkan kelas 29?C-31?C semakin berkurang dan kelas 32?C34?C mendominasi pada tahun 2013. Kelas Non vegetasi pada tahun 1997 sebesar 3225,05 hektar kemudian seiring bertambahnya lahan terbangun luas non vegetasi meningkat menjadi 5522,63 hektar pada tahun 2015. \n2. Pengaruh perubahan vegetasi terhadap suhu permukaan tahun 1997 dengan tahun 2002 memiliki nilai sebesar -0,06 atau 6 % yang artinya perubahan vegetasi antara tahun 1997 dengan tahun 2002 mempengaruhi variabel suhu permukaan dengan nilai sebesar 6 %.  Pengaruh perubahan vegetasi terhadap suhu permukaan tahun 2002 dengan tahun 2013 memiliki nilai sebesar -0,46 atau 46 % yang artinya perubahan vegetasi antara tahun 2002 dengan tahun 2013 mempengaruhi variabel suhu permukaan dengan nilai sebesar 46 %. Pengaruh perubahan vegetasi terhadap suhu permukaan tahun 2013 dengan tahun 2015 memiliki nilai sebesar- 0,39 atau 39 % yang artinya perubahan vegetasi antara tahun 2013 dengan tahun 2015 mempengaruhi variabel suhu permukaan dengan nilai sebesar 39 %. Nilai (?) mengartikan bertentangan atau berlawanan yang artinya suhu permukaan berkolerasi negatif dengan kerapatan vegetasi. Semakin tinggi suhu permukaan  maka semakin rendah  nilai indeks vegetasi. \n3. Dari hasil data suhu yang diolah menggunakan DEM didapatkan suhu yang mendominasi adalah kelas 23?-25?C. Perbandingan hasil suhu permukaan dari citra landsat dengan suhu dari data DEM SRTM memiliki selisih yang besar pada kelas 23?-25?C dengan selisih sebesar 66016,16 hektar dan nilai presentase 96 %. ', '1. Penilitian seharusnya memilih daerah yang berkembang dengan kota-kota besar yang memiliki perubahan vegetasi yang cukup siginifikan sehingga bisa didapatkan hasil yang sesuai. \n2. Untuk  melihat perubahan yang signifikan rentang tahun juga perlu diperhitungkan untuk melihat hasil yang sesuai. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/10597/10288', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
