(310, 'Muhammad Danny R', '21110111130031', 'Analisis Spasial Ketersediaan Ruang Terbuka Hijau Terhadap Jumlah Penduduk Di Kota Solo', 'Moehammad Awaluddin, S.T., M.T', 'Ir. Hani\'ah, M.Si', 'Kota Surakarta', '33.72', 'Karto SIG', 2016, '1. Citra IKONOS Tahun 2011\n2. Peta Pola Ruang Kota Solo\n3. Peta Administrasi Kota Solo\n4. Data Jumlah Penduduk Tahun 2014', '1. Overlay\n2. Interpretasi Citra\n3. Digitasi', '1. Peta RTH Kota Solo\n2. Kesesuaian RTH terhadap UU No. 26 Tahun 2017\n3. Ketersediaan Taman Kota terhadap Jumlah Penduduk', '1. Berdasarkan pengolahan citra resolusi tinggi IKONOS tahun 2011, didapatkan luas Ruang Terbuka Hijau (RTH) Kota Solo sebesar 581,101 Ha atau sekitar 12,458% dari total luas wilayah Kota Solo. Sehingga dapat disimpulkan bahwa luas RTH belum memenuhi jumlah yang ditentukan dalam UU Nomor 26 Tahun 2007 tentang Penataan Ruang, yang menetapkan bahwa proporsi RTH publik pada wilayah perkotaan minimal sebesar 20% dari luas kota.\n2. Berdasarkan jumlah penduduk dan sampel prediksi pertumbuhan penduduk mulai tahun 2014 hingga tahun 2019 per Kecamatannya, didapatkan luas RTH di Kota Solo belum memenuhi kebutuhan RTH secara keseluruhan. Sedangkan persentase kebutuhan RTH dari tahun 2014 sampai 2019 mengalami kenaikan dari 25,1% menjadi 25,2%.\n3. Berdasarkan luas taman aktif di tiap kecamatan di Kota Solo, keberadaan taman aktif tidak merata pada setiap kecamatannya. Tiga Kecamatan yang memenuhi standar kapasitas taman aktif menurut Peraturan Menteri Pekerjaan Umum Nomor 05/PRT/M/2008 sebesar 0,3 m?/jiwa, yaitu Kecamatan Pasar Kliwon yang memiliki kapasitas taman paling besar yaitu 0,943 m?/jiwa, kemudian Kecamatan Laweyan 0,575 m?/jiwa dan Kecamatan Banjarsari 0,445 m?/jiwa. Sedangkan Kecamatan Jebres dan Serengan tidak memenuhi standar kapasitas taman tersebut, terutama Kecamatan Serengan yang tidak memiliki taman aktif sama sekali.', '1. Pemerintah diharapkan lebih mengembangkan persebaran RTH yang signifikan agar dapat memenuhi ketentuan UU No 26 Tahun 2007 tentang penataan ruang, dengan proporsi RTH minimal 30% dari luas Kota.\n2. Pemerintah harus bisa mempertahankan kesesuaian RTH agar tidak terjadi pengurangan karena RTH dapat meningkatkan kualitas lingkungan Kota Solo.\n3. Perlu adanya upaya dari pemerintah untuk menambah taman aktif, terutama Kecamatan Serengan yang tidak memiliki Taman aktif sama sekali.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/12821/12424', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
