(336, 'Muhammad Nida Hakim El Wafa', '21110112130067', 'Analisis Penguasaan Pemilikan Penggunaan dan Pemanfaatan Tanah (P4T) Berdasarkan Kegiatan Normalisasi Sungai Menggunakan SIG Tahun 2016 (Studi Kasus : Kali Beringin Kelurahan Mangkang Wetan) ', 'Ir. Sawitri Subiyanto, M.Si', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Kota Semarang', '33.74', 'Pertanahan Kewilayahan', 2017, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/15377/14869', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(337, 'Alfien Rahmenda', '21110111120010', 'Pembuatan Aplikasi Sebaran Lokasi Kos Berbasis WebGIS Menggunakan Google Map API (Studi Kasus: Area Kampus Universitas Diponegoro)', 'Moehammad Awaluddin, S.T., M.T', 'Arief Laila Nugraha, S.T., M.Eng', 'Kota Semarang', '33.74', 'Karto SIG', 2017, '1. Peta Administrasi Kabupaten Jawa Tengah, Peta Tata Guna Lahan, dan Peta Jenis Tanah yang di dapat dari Badan Penanggulangan Bencana Daerah Kabupaten Semarang. 2. Data Curah Hujan Kabupaten Semarang bulan Januari ? Juni 2016 yang di dapat dari Badan Meteorologi Klimatologi dan Geofisika Provinsi Jawa Tengah. \n3. Citra DEM SRTM 30 Jawa Tengah \n4. Data Kejadian Bencana Kabupaten Semarang Tahun 2015-2016 dari Badan Penanggulangan Bencana Daerah Kabupaten Semarang. \n5. Data hasil wawancara untuk pembobotan AHP yang didapat dari wawancara kepada Kepala Seksi Pencegahan dan Kesiapsiagaan Badan Nasional Penganggulangan Bencana Kabupaten Semarang. ', 'Metode Analytical Hierarchy Process (AHP) dan Permen PU No. 22/PRT/M/2007', '1. Kelas Potensi Tinggi Pada metode Permen PU, kelas potensi tinggi di Kabupaten Semarang tersebar di 16 Kecamatan dengan  Luas Total 18.568,3869 Ha atau 18,641%. Sedangkan pada metode AHP, kelas potensi Tinggi di Kabupaten Semarang tersebar di  14 Kecamatan dengan luas total 6.642,9900 Ha atau 6,635%. \n2. Kelas Potensi Sedang Pada metode Permen PU, kelas potensi sedang di Kabupaten Semarang tersebar di 19 Kecmatan dengan luas total 51.755,2320 Ha atau 51,455%. Sedangkan pada metode AHP, kelas potensi sedang di Kabupaten Semarang tersebar di 19 Kecamatan dengan luas total 47.226,5620 Ha atau 47,167%. \n3. Kelas Potensi Rendah Pada metode Permen PU, kelas potensi sedang di Kabupaten Semarang tersebar di 12 Kecamatan dengan luas total 30.398,7463 Ha atau 30,084%. Sedangkan pada metode AHP, kelas potensi rendah di Kabupaten Semarang tersebar di 19 Kecamatan dengan luas total 46.257,1992 Ha atau 46,199%. ', '1. Dari Penelitian yang dilakukan mengenai Potensi Bencana Tanah Longsor di Kabupaten Semarang ini Terbagi menjadi tiga zonasi atau kelas potensi, yaitu sebagi berikut : a. Kelas Potensi Tinggi Pada metode Permen PU, kelas potensi tinggi di Kabupaten Semarang tersebar di 16 Kecamatan dengan  Luas Total 18.568,3869 Ha atau 18,641%. Sedangkan pada metode AHP, kelas potensi Tinggi di Kabupaten Semarang tersebar di  14 Kecamatan dengan luas total 6.642,9900 Ha atau 6,635%. b. Kelas Potensi Sedang Pada metode Permen PU, kelas potensi sedang di Kabupaten Semarang tersebar di 19 Kecmatan dengan luas total 51.755,2320 Ha atau 51,455%. Sedangkan pada metode AHP, kelas potensi sedang di Kabupaten Semarang tersebar di 19 Kecamatan dengan luas total 47.226,5620 Ha atau 47,167%. c. Kelas Potensi Rendah Pada metode Permen PU, kelas potensi sedang di Kabupaten Semarang tersebar di 12 Kecamatan dengan luas total 30.398,7463 Ha atau 30,084%. Sedangkan pada metode AHP, kelas potensi rendah di Kabupaten Semarang tersebar di 19 Kecamatan dengan luas total 46.257,1992 Ha atau 46,199%. \n2. Dari perbandingan antara 20 sampel validasi lapangan yang dilakukan dengan dua metode yang digunakan dalam penelitian ini  di dapatkan hasil yaitu : a. Terdapat 7 sampel validasi lapangan yang sesuai dengan dua metode yang digunakan baik Permen PU maupun AHP b. Terdapat 3 sampel validasi lapangan yang tidak sesuai dengan dua metode yang digunakan baik Permen PU maupun AHP c. Terdapat 5 sampel validasi lapangan yang lebih sesuai dengan metode Permen PU daripada metode AHP d. Terdapat 5 sampel validasi lapangan yang lebih sesuai dengan metode AHP daripada metode Permen PU Sehingga dari data diatas didapatkan nilai akurasi data untuk metode Permen PU sebesar 55% sedangkan nilai akurasi data untuk metode AHP sebesar 50%', '1. Ketersediaan data dasar (parameter) yang terbaru sehingga memudahkan bagi peneliti untuk membuat peta dengan keadaan geografi yang paling baru dan diharapakan hasilnya lebih relevan dengan kondisi sebenarnya di lapangan. \n2. Ketelitian bagi peneliti saat pengolahan data sangat diperlukan karena akan sangat berpengaruh terhadap hasil akhirnya. \n3. Pemilihan Narasumber wawancara untuk metode AHP diharapkan kepada orang yang benar-benar ahli dan mempunyai pengetahuan yang mendalam dalam hal tersebut.\n4. Dalam melakukan validasi lapangan, sampel yang akan diambil harusnya merata untuk tiap-tiap kelas sehingga dalam melakukan analisis kesesuaian didapatkan keakuratan data yang lebih baik. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/15022/14521', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
