INSERT INTO `journals` (`id`, `nama`, `nim`, `title`, `dosbing_1`, `dosbing_2`, `location`, `kode_nasional`, `jenis_kk`, `tahun`, `data`, `metode`, `hasil`, `kesimpulan`, `saran`, `download`, `created_at`, `updated_at`) VALUES
(401, 'Aisah Hajar', '21110113130092', 'Pemanfaatan Lidar untuk Evaluasi Ketinggian Bangunan di Kawasan Jalan Pandanaran, Semarang', 'Arwan Putra Wijaya, ST., MT', 'Nurhadi Bashit, ST., M.Eng', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2017, '1.  Citra Satelit Landsat 5 tahun 2009 \n2.  Citra Satelit Landsat 8 tahun 2013 dan 2017 \n3.  Peta Rencana Tata Ruang Wilayah 20112031 yang didapatkan dari BAPPEDA \n4.  Peta Administrasi Kabupaten Boyolali yang didapatkan dari BAPPEDA Kabupaten Boyolali \n5.  Peta RBI 1:25.000', 'Digitasi dan overlay ', 'Hasil penitian ini berupa perubahan penggunaan dan pemanfaatan lahan. Dimana perubahan dan pemanfaatan lahan dilakukan analisis setiap 4 tahun yaitu tahun 2009-2013 dan tahun 2013-2017 sedangkan kesesuaiannya yaitu  Kabupaten Boyolali pada tahun 2009 didapat luasan sebesar 100982,84 hektar atau 92,25% dari luas kabupaten, sementara seluas 8485,60 hektar atau 7,75% dari luas kabupaten penggunaan lahannya tidak sesuai dengan perencanaannya.Tahun 2013 didapat luasan sebesar 10615,51 hektar atau 92,83% dari luas kabupaten, sementara seluas 7852, 93 hektar atau 7,17% dari luas peggunaan lahannya tidak sesuai. Tahun 2017 didapat luasan sebesar 10615,51 hektar atau 93,43% dari luas kabupaten, sementara seluas 7852, 93 hektar atau 6,57% dari luas peggunaan lahannya tidak sesuai. ', '1. Pertumbuhan Kabupaten Boyolali atau perubahan penggunaan lahan Kabupaten Boyolali selama 8 tahun terjadi paling tinggi di Kecamatan Sawit dengan presentase kenaiakan penggunaan permukiman sebesar 5,57%, sedangkan untuk perubahan penggunaan lahan paling rendah terdapat di Kecamatan Selo dengan presentase kenaiakan penggunaan permukiman sebesar 0,30%. Perubahan penggunaan lahan paling luas terdapat di Kecamatan Simo dengan kenaikan penggunaan lahan permukiman sebesar 248,24 hektar, sementara perubahan penggunaan lahan paling kecil berada di Kecamatan Selo dengan kenaikan penggunaan lahan permukiman sebesar 12,10 hektar. Perubahan ini menandakan bahwa pembangunan di Kabupaten Boyolali tidak hanya berpusat di ibukota kabupaten saja tetapi merata ke setiap kecamatan. \n2. Perubahan pemanfaatan lahan yang ada di Kabupaten Boyolali selama 8 tahun terjadi peningkatan pada klasifikasi kegiatan sosial dengan sosial mengalami peningkatan sebesar 91,41 hektar dan pemanfaatan tempat tinggal naik 1363,16 hektar, sementara kelas tidak ada pemanfaatan mengalamai penurunan sebesar 210,61 hektar, kegiatan ekonomi juga mengalami penurunan sebesar 1275,9 hektar, hal ini disebabkan karena kebutuhan akan tempat tinggal dan sarana dan prasarana umum di Kabupaten Boyolali mulai meningkat. 3. Hasil dari kesesuaian penggunaan lahan di Kabupaten Boyolali tahun 2009 sebesar 92,25%, tahun 2012 sebesar 92,83% dan tahun 2017 sebesar 93,43% dari luas kabupaten penggunaan lahannya. Data tersebut menunjukan progres kesesuaian penggunaan lahan Kabupaten Boyolali selalu naik dan mendekati rencana pola ruangnya.', '1. Untuk penelitian selanjutnya, sebaiknya menggunakan citra satelit yang resolusi spasialnya lebih baik dari Landsat 5 dan Landsat 8, karena dengan resolusi spasial yang sangat rendah menyebabkan kesulitan pada saat proses digitasi klasifikasi lahan. \n2. Interval penggunaan data citra yang lebih lama, agar perubahan dari penggunaan dan pemanfaatan lahan Kabupaten Boyolali dapat terlihat lebih jelas. \n3. Sebaran titik survei validasi sebaiknya lebih banyak dan merata ke area penelitian, agar ketelitian dalam menginterpertasi citra lebih detail. \n4. Pengolahan kesesuaian lahan sebaiknya dilakukan dengan mengacu pada satuan bidang tanah agar diperoleh akurasi luasan kesesuaian lahan yang lebih tinggi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/18165/17238', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
