(433, 'Restu Fadilla', '21110113130101', 'Analisis Kesesuaian Perubahan Penggunaan Lahan Terhadap Rencana Tata Ruang / Wilayah di Kecamatan Penjaringan Kota Administratif Jakarta Utara Menggunakan Sistem Infomasi Geografis ', 'Ir. Bambang Sudarsono, MS', 'Nurhadi Bashit, ST., M.Eng.', 'Kota Jakarta Utara', '31.72', 'Pertanahan Kewilayahan', 2018, '1. Citra SPOT 6 tahun 2013 dan 2017. \n2. Peta Rencana Tata Ruang/Wilayah Jakarta Tahun 2011-2030. \n3. Peta Batas Administrasi Kecamatan Penjaringan. \n4. Data GPS Kecamatan Penjaringan tahun 2016 5. Data Validasi Lapangan. \n ', 'Digitasi on screen dan overlay ', 'Tahun 2013 Lahan sesuai : 2.848,019 Ha (77,84%) Lahan tidak sesuai :810,629 Ha (22,16%)  Tahun 2017 Lahan sesuai : 2.890,246 Ha (79,00%)  Lahan tidak sesuai : 768,402  Ha (21,00%)', '1. Penggunaan lahan pada Kecamatan Penjaringan dengan total luas 3.658,648 ha. Penggunaan lahan pada tahun 2013 terdiri atas Kawasan Perumahan dengan luas sebesar 1.333,123 ha atau 36,44%, Kawasan Hijau Budidaya dengan luas sebesar 924,558 ha atau 25,27%, Kawasan Industri dan Perdagangan dengan luas sebesar 490,366 ha atau 13,40%, Kawasan Perkantoran, Perdagangan dan Jasa dengan luas sebesar 414,385 ha atau 11,33%, Kawasan Ruang Terbuka Biru dengan luas sebesar 249,538 ha atau 6,82%, Kawasan Hijau Lindung dengan luas sebesar 212,423 ha atau 5,80% dan Kawasan Perkantoran, Perdagangan dan Jasa Taman dengan luas sebesar 34,255 ha atau 0,94%. Sementara Penggunaan lahan pada tahun 2017 terdiri atas Kawasan Perumahan dengan luas sebesar 1.319,097 ha atau 36,05%, Kawasan Hijau Budidaya dengan luas sebesar 865,844 ha atau 23,67%, Kawasan Industri dan Perdagangan dengan luas sebesar 509,040 ha atau 13,91%, Kawasan Perkantoran, Perdagangan dan Jasa dengan luas sebesar 455,288 ha atau 12,44%, Kawasan Ruang Terbuka Biru dengan luas sebesar 264,780 ha atau 7,24%, Kawasan Hijau Lindung dengan luas sebesar 210,344 ha atau 5,75% dan Kawasan Perkantoran, Perdagangan dan Jasa Taman dengan luas sebesar 34,255 ha atau 0,94%. \n2. Kesesuaian penggunaan lahan tahun 2013 terhadap Rencana Tata Ruang/Wilayah (RTRW) Jakarta tahun 2030 adalah sebesar 2.848,019 ha atau 77,84% dari total luas Kecamatan Penjaringan, sedangkan kesesuaian lahan tahun 2017 terhadap RTRW Jakarta Tahun 2011-2030 adalah sebesar 2.890,246 ha atau 79,00% dari total luas Kecamatan Penjaringan. \n3. Perubahan penggunaan lahan yang didapatkan berupa peningkatan dan penurunan luas penggunaan lahan. Luas lahan yang bertambah yaitu Kawasan Industri dan Pergudangan sebesar 18,674 ha (3,81%), Kawasan Perkantoran, Perdagangan dan Jasa sebesar 40,903 ha (9,87%) dan Kawasan Ruang Terbuka Biru sebesar 15,242 ha (6,11%), sedangkan luas lahan yang berkurang yaitu Kawasan Perumahan sebesar 14,026 ha (1,05%), Kawasan Hijau Budidaya sebesar 58,714 ha (6,35%) dan Kawasan Hijau Lindung sebesar 2,079 ha (0,97%). Sementara itu, untuk kesesuaian perubahan penggunaan lahan dari tahun 2013 ke tahun 2017 terhadap RTRW Jakarta Tahun 2011-2030, terdapat kawasan yang perkembangannya menyesuaikan RTRW Jakarta Tahun 2011-2030 yaitu Kawasan Industri dan Pergudangan di sebesar 21,292 ha, Kawasan Ruang Terbuka Biru sebesar 11,830 ha, Kawasan Hijau Budidaya sebesar 10,416 ha, Kawasan Perkantoran, Perdagangan dan Jasa sebesar 8,851 ha, Kawasan Perumahan sebesar 4,926 ha dan Kawasan Hijau Lindung sebesar 0,013 ha. Sementara itu, dalam kurun waktu 4 tahun, kesesuaian perubahan penggunaan lahan dari tahun 2013 ke tahun 2017 terhadap RTRW Jakarta Tahun 2011-2030 mengalami peningkatan sebesar 1,16%', '1. Citra satelit yang digunakan sebaiknya citra yang beresolusi lebih tinggi sehingga lebih mudah dalam melakukan interpretasi citra. \n2. Titik kontrol tanah (GCP) yang digunakan dalam rektifikasi citra sebaiknya menggunakan hasil pengukuran langsung GPS atau bisa menggunakan citra/peta dasar dengan resolusi/skala yang lebih bagus/besar. \n3. Mempersiapkan dan mencari informasi tentang alat, data dan juga ketersediannya perlu dilakukan sebelum penelitian dimulai agar proses pengolahan data tidak terhambat dengan masalah ketersediaan alat dan data. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/19328/18336', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
