(442, 'Carlo Pradipta', '21110113140090', 'Analisis Kesesuaian Ruang Terbuka Hijau dan Taman Kabupaten Sukoharjo Menggunakan Sistem Informasi Geografis', 'Arief Laila Nugraha, S.T., M.Eng', 'Ir. Hani\'ah, M.Si', 'Kab. Sukoharjo', '33.11', 'Karto SIG', 2018, '1. Peta Administrasi Kabupaten Sukoharjo\n2. Peta Jaringan Jalan Kabupaten Sukoharjo\n3. Cira Quickbird Tahun 2009\n4. Data Taman Kabupaten Sukoharjo\n5. Data Jumlah Penduduk Kabupaten Sukoharjo\n6. Peraturan Menteri Pekerjaan Umum No. 05 Tahun 2008', '1. Overlay\n2. Interpretasi Citra\n3. Digitasi', '1. Peta dan Luasan RTH Kabupaten Sukoharjo\n2. Sebaran dan Klasifikasi RTH Dominan\n3. Keadaan RTH Kecamatan Sukoharjo jika Sawah Disertakan', '1. Luas total RTH Kabupaten Sukoharjo adalah sebesar 9.319.144,411 m2.\n2. Klasifikasi lapangan dan jalur hijau jalan paling dominan berada di Kecamatan Bendosari. Klasifikasi pemakaman paling dominan berada di Kecamatan Grogol. Kemudian klasifikasi Sempadan sungai dan Sempadan Kereta paling dominan berada di Kecamatan Nguter. Kemudian klasifikasi taman paling dominan berada di Kecamatan Sukoharjo. Dan klasifikasi hutan kota yang paling dominan berada di Kecamatan Bulu.\n3. Berdasarkan perhitungan luasan bisa dilihat total luas RTH dan sawah di Kecamatan Sukoharjo adalah sebesar 27.647.548,597 m2 dan jika dibandingkan dengan luas Kecamatan Sukoharjo yang memiliki luas sebesar 46.665.397,23 m2 maka luas RTH dan Sawah yang ada di Kecamatan Sukoharjo adalah 59,246% dari luas kecamatan.', '1. Sebaiknya lebih mengembangkan persebaran RTH yang signifikan agar dapat memenuhi kebutuhan RTH di Kabupaten Sukoharjo dan pemerataan RTH di setiap kecamatannya.\n2. Sebaiknya perlu menambahkan jumlah taman ditiap kecamatan dengan persebaran yang merata di Kabupaten Sukoharjo.\n3. Untuk penelitian selanjutnya disarankan untuk menggunakan citra resolusi tinggi dan terbaru.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/19331/18339', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
