(483, 'Dani Purba', '21110114120048', 'Analisis Kebutuhan Ruang Terbuka Hijau Berdasarkan Pendekatan Kebutuhan Oksigen Di Kota Pekalongan Dengan Menggunakan Penginderaan Jauh dan Sistem Informasi Geografis', 'Ir. Sawitri Subiyanto, M.Si.', 'Ir. Hani?ah, M.Si', 'Kota Pekalongan', '33.75', 'Karto SIG', 2018, '1. Peta Administrasi Kota Pekalongan Tahun 2016\n2. Peta Tata Guna Lahan Kota Pekalongan Tahun 2016\n3. Peta Jaringan Jalan dan Sungai Kota Pekalongan Tahun 2016\n4. Citra Quickbird Tahun 2015\n5. Data Jumlah Penduduk, Ternak, dan Kendaraan Bermotor Tahun 2018\n6. Citra Sentinel-2A\n7. Peraturan Menteri Pekerjaan Umum No. 05 Tahun 2008', '1. Overlay\n2. Interpretasi Citra\n3. Digitasi', '1. Peta RTH Kota Pekalongan\n2. Kesesuaian RTH Terhadap Peraturan Menteri No. 05 Tahun 2008\n3. Luasan RTH untuk Memenuhi Kebutuhan Oksigen', '1. Ruang terbuka hijau publik yang terdapat di Kota Pekalongan terdiri atas Hutan Kota 7,42 Ha, Jalur Hijau Jalan 4,32 Ha, Lapangan 32,60 Ha, Pemakaman 31,94 Ha, Sempadan Kereta Api 8,31 Ha, Sempadan Pantai 24,73 Ha, Sempadan Sungai 105,63 Ha dan Taman Kota 5,89 Ha. Sedangkan Ruang Terbuka Hijau Privat yang dimiliki Kota Pekalongan Sebesar 401,24 Ha dan menjadi klasifikisai RTH terbesar di Kota Pekalongan. Dan keadaan RTH di Kecamatan Pekalongan Barat dengan luas RTH publik 54,27 Ha dan RTH privat sebesar 109,27 Ha, Kecamatan Pekalongan Timur dengan luas RTH publik 33,85 Ha dan RTH privat 86,24 Ha, Kecamatan Pekalongan Utara dengan luas RTH publik 56,60 Ha dan RTH privat 68,59 Ha dan Kecamatan Pekalongan Selatan memiliki luasan RTH dengan RTH publik 76,13 Ha dan RTH privat 137,13 Ha.\n2. Berdasarkan pengolahan dengan Citra Quickbird 2015 dan Citra Sentinel-2A 2018, didapatkan luas RTH di Kota Pekalongan sebesar 622,08 Ha (13,75 %), dengan RTH publik sebesar 220,85 Ha (4,88 %) dan RTH privat 401,24 Ha (8,86 %). Sehingga dapat disimpulkan bahwa luas RTH belum memenuhi jumlah yang ditentukan dalam Peraturan Menteri Pekerjaan Umum Nomor: 05/PRT/M/2008 tentang Pedoman Penyediaan dan Pemanfaatan RTH di Kawasan Perkotaan dimana menetapkan bahwa proporsi RTH publik pada wilayah perkotaan minimal sebesar 20% dan RTH privat minimal 10% dari luas wilayahnya.\n3. Bila dilihat dari kebutuhan Ruang Terbuka Hijau berdasarkan Kebutuhan Oksigen, Kota Pekalongan memerlukan Ruang Terbuka Hijau sebesar 690,95 Ha sedangkan RTH existing hanya 622,08 Ha. Sehingga jika dibandingkan RTH terhadap kebutuhan oksigen dengan luas RTH yang ada belum memenuhi/mencukupi, Perlu menambahkan luasan Ruang Terbuka Hijau sebesar 68,87 Ha lagi untuk memenuhi kebutuhan oksigen di Kota Pekalongan.', '1. Untuk penelitian selanjutnya disarankan untuk menggunakan citra resolusi tinggi dan terbaru agar identifikasi dengan di lapangan sesuai.\n2. Sebaiknya meminta data RTH dari instansi yang bersangkutan agar lebih memudahkan dalam interpretasi.\n3. Pemerintah diharapkan lebih mengembangkan persebaran RTH yang signifikan agar dapat memenuhi PerMen PU 05/PRT/M/2008 tentang Pedoman Penyediaan dan Pemanfaatan RTH di Kawasan Perkotaan dan untuk memenuhi kebutuhan oksigen di Kota Pekalongan.\n4. Perlu adanya upaya dari pemerintah untuk menambah taman aktif, terutama Kecamatan Pekalongan Utara yang tidak memiliki Taman sama sekali.\n5. Mengingat besarnya volume kendaraan bermotor, maka perlu dilakukan perbanyak RTH jalur hijau jalan untuk menurunkan tingkat pencemaran udara yang dihasilkan.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22431/20567', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
