(496, 'Getma Lavemia', '21110114120031', 'Analisis Nilai Ekonomi Kawasan Menggunakan Travel Cost Method (TCM) dan Contingen Valuation Method (CVM) Untuk Pembuatan Zona Nilai Ekonomi Kawasan dengan SIG', 'Ir. Sawitri Subiyanto, M.Si.', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Kab. Semarang', '33.22', 'Pertanahan Kewilayahan', 2018, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22424/20560', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(497, 'Meiga Nugrahani', '21110114120016', 'Pemanfaatan Nilai Willingness To Pay Untuk Pembuatan Peta Zona Nilai Ekonomi Kawasan Umbul Di Klaten Dan Peta Utilitas Sistem Informasi Geografis (Studi Kasus : Umbul Ponggok Dan Obyek Mata Air Cokro)', 'Ir. Sawitri Subiyanto, M.Si.', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Kab. Klaten ', '33.10', 'Pertanahan Kewilayahan', 2018, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22420/20556', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(498, 'Laurentius Immanuel  Yudit Prabowo', '21110114130058', 'Pengamatan Deformasi Sesar Kaligarang dengan Metode Survei GNSS Tahun 2018', 'M. Awaluddin, ST., MT', 'Fauzi Janu Amarrohman, ST., M.Eng', 'Kota Semarang', '33.74', 'Terestris Hidro', 2018, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22432/20568', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(499, 'Naryoko', '21110112140082', 'Kajian Terapan Teknologi UAV dan SIG dalam Pembuatan Peta Desa Skala 1:1000 Untuk Kelurahan Tembalang Wilayah RW-04 Tahun 2017', 'Dr. Yudo Prasetyo, ST., MT', 'Arief Laila Nugraha, ST., M.Eng', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2019, '1. Foto Udara UAV\n2. Data GPS GCP\n3. Data GPS CORS UNDIP', 'GPS Metode Statik, \nMetode Perhitungan CE90 dan LE90', 'RMSE Horisontal GCP adalah 0,04315 m dengan ketelitian orthorektifikasi memenuhi standar kelas II\nRMSE Vertikal GCP adalah 0,027456642 m dengan ketelitian proses orthoretifikasi memenuhi standar kelas I\n\nHasil RMSE horizontal ICP adalah 5,779525315 cm sedangkan RMSE vertikal ICP adalah  3,372661692 cm\n\nUji Ketelitian Peta CE90 adalah 0,0877 m dan LE90 adalah 0,0556 m', '1.) Hasil analisis tingkat kualitas peta desa yang\nmeliputi RW 04 dan RW 08 Kelurahan\nTembalang terhadap ketentuan peraturan\nPerka BIG NO. 15 Tahun 2014 dengan\nvalidasi geometri horizontal dan validasi\ngeometri vertikal maka dilakukan\nperhitungan CE90 dan LE90. Hasil nilai\nCE90 yang didapat adalah 0,0877 m dan hadil\nnilai LE90 yang didapat adalah 0,0556 yang\nmana dengan demikian nilai yang dihasilkan\ntersebut memenuhi standar ketelitian peta\ndasar dengan ketelitian horizontal kelas 1 secara vertical maupun horizontal untuk peta\nskala 1:1.000 yaitu kurang dari 0,20 m.\n2.) Dengan terapan teknologi UAV dan SIG\ndapat diterapkan dalam metode pembuatan\npeta desa karena memiliki hasil standar\nakurasi geometri yang baik. Mengidentifikasi\ndeliniasi batas, jalan, sungai, luas area yang\nterdiri dari beberapa RW, RT dan sarana\nprasarana yang ada. Menghasilkan peta batas\nwilayah, peta sarana dan prasarana.', '1. Apabila pengolahan data foto udara\nmenggunakan software Agisoft\nPhotoscan, maka sebelum melakukan\npengambilan data harus membaca buku\npanduan darisoftware tersebut karena\nakan sangat membantu untuk teknik\npelaksanaan dari pengambilan data\nhingga ke pengolahan.\n2. Pemotretan foto udara menggunakan\nUAV untuk dilakukan dari ketinggian\nyang sama. Hal tersebut agar antar foto\nudara yang diambil dari waktu yang\nberbeda memiliki keseragaman.\n3. Pada pemotretan dengan UAV, tinggi\nterbang UAV diusahakan serendah\nmungkin dan tetap memperhatikan tinggi\nobstacle agar resolusi yang didapatkan\ndapat secara maksimal dan nilai sidelap,\noverlap dibuat tinggi agar tidak terjadi\nlubang data karena kurangnya\npertampalan.\n4. Penentuan posisi titik GCP untuk\nmempertimbangkan kondisi obstruksi\npengamatan GPS. Hindari penempatan\ntitik GCP pada tempat yang terdapat\ngangguan interferensi elektris dan juga\nmultipath.\n5. Pengamatan GPS untuk titik GCP harap\nuntuk dilakukan dalam waktu yang lebih\nlama dan menggunakan lebih banyak titik\nGCP. Karena GCP berperan penting\ndalam pembentukan DEM, yaitu pada\ntahap orthorektifikasi sehingga\ndiharapkan DEM yang terbentuk\nmemiliki akurasi posisi X, Y, dan Z yang\nbagus.\n6. Melakukan validasi untuk geometri\nhorizontal dan vertikal dalam jumlah\nobjek yang lebih banyak dan menyebar\nagar kualitas validasi lebih baik.\n7. Untuk mendapatkan hasil yang\nmaksimal, pengolahan dilakukan dengan\nmenggunakan opsi high agar tidak terjadi\npenurunan kualitas data dari hasil report.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22440/20576', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(500, 'Kurniawan Putra Widya Wardana', '21110113120048', 'Estimasi Produksi Padi Menggunakan Model 3D Multitemporal Pada Unmanned Aerial Vehicle (UAV) (Studi Kasus : Kelurahan Kramas, Tembalang, Semarang) ', 'Ir. Sawitri Subiyanto, M.Si', 'Ir. Hani?ah, M.Si', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2019, 'a. Foto Udara UAV\nb. Data GPS CORS Undip\nc. Data GPS GCP\nd. Data Tinggi Padi\ne. Data Kuisioner', 'Level of Detail (LoD), \n\nAkuisisi koordinat GCP dan ICP dilakukan dengan metode pengamatan statik. Metode pengolahan dengan metode radial.\n\nMetode yang digunakan untuk membentuk model 3D adalah dengan\noverlay data DSM dan data DTM yang diperoleh dari pointsclouds.', 'RMS horizontal foto I, II dan III adalah 0.0552 m, 0.0682 m dan 0.0217 m.\nRMS vertikal foto I, II dan 0.0063 m, 0.0037 m dan 0.0088 m.\n\nRMS horizontal ICP I, II dan III adalah 0.0455 m, 0.0082 m dan 0.0457 m.\nRMS vertikal ICP I, II dan III adalah 0.0269 m, 0.0239 m dan 0.0632 m.\n\nKetelitian orthotofo pada foto I dan II  masuk kedalam kelas II dan foto III kelas I\n\nPerbedaan tinggi padi (dH) pada foto I, II, dan III adalah RMSe 0.133 m, 0.084 m dan 0.080 m.', '1.) Berdasarkan analisis model 3D tanaman padi yang\ndiperoleh dari foto udara UAV didapat kesimpulan\ndalam pembentukan model tanaman padi diperlukan\ndata DEM dan DTM.\na. Model 3D yang dibentuk.secara visual\ndikelaskan pada LoD 2 dikarenakan tiap model\nmemiliki visual atap bangunan atau rumah sudah dapat dibedakan antara bangunan besar dan\nkecil, serta vegetasi dapat dipetakan.\nb. Secara geometri model 3D yang dibentuk\ntermasuk pada LoD 3 dilihat dari geometri\nketinggian karena memiliki geometri ketinggian\nsebesar 0.133 m, 0.84 m, dan 0.80 m dimana\nmemiliki nilai lebih kecil 0.5 m. Perbedaan LoD\nvisualisasi dan LoD geometri ketinggian\ndisebabkan karena pada penelitian ini\nmembentuk model 3D tidak secara detail. Untuk\nmembentuk 3D secara detail diperlukan\npointclouds yang banyak serta pertampalan foto\nyang banyak.\n2.) Berdasarkan hasil dan analisis model 3D yang\ndibentuk dimana ketelitian yang didapatkan dari\nperbandingan tinggi tanaman padi pada model 3D\ndengan data pengukuran di lapangan. Dimana\nketinggian tanaman pada model 3D diperoleh dari\nreduksi tinggi geodetik ke tinggi orthometrik\nberdasarkan EGM 2008 didapatkan ketelitian ratarata sebesar 0.099 m. Dengan ketelitian tersebut\npenggunaan EGM 2008 untuk mereduksi tinggi\nmasih terpaut besar. Dimana objek yang\ndibandigkan adalah tanaman padi yang memiliki\ntinggi maksimal 1 meter.', '1. Diperlukan persiapan yang matang baik dari segi\nmateri pengetahuan, persiapan dan perencanaan\nagar didapatkan hasil akuisisi data yang sesuai\nharapan.\n2. Untuk membentuk 3D yang lebih detail dibutuhkan\njalur menyilang dengan jalur terbang utama, agar\npertampalan foto lebih banyak.\n3. Pada pengamatan GPS, perlu ditentukan secara\nspesifik titik mana yang akan dilakukan\npengukuran, diusahakan daerah yang memiliki\nmobilitas yang rendah.\n4. Diperlukan data pengamatan tinggi tanaman padi\nyang banyak dan bervariasi agar dapat klasifikasi\ntinggi dan usia tanaman yang mendetail.\n5. Apabila pengolahan data foto udara menggunakan\nsoftware Pix4Dmapper, maka sebelum melakukan\npengambilan data harus membaca buku panduan\ndari software tersebut karena akan sangat membantu\nuntuk teknik pelaksanaan dari pengambilan data\nhingga ke pengolahan.\n6. Untuk penelitian selanjutnya, perlu dilakukan\nvalidasi dengan Total Station untuk mengetahui\nperbedaan posisi X dan Y yang detail pada titik\nvalidasi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22756/20804', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(501, 'Siti Fathimah', '21110114130096', 'Survey Deformasi Daerah Jembatan Penggaron Dengan Metode GPS Tahun 2018', 'M. Awaluddin, ST., MT', 'Bambang Darmo Yuwono, ST., MT', 'Kota Semarang', '33.74', 'Terestris Hidro', 2019, 'Data Pengukuran GPS Tahun 2015\nData Pengukuran GPS Tahun 2016\nData Pengukuran GPS Tahun 2018', 'metode pengamatan GPS statik\nmetode linier fit\n', 'Nilai Kecepatan Titik Pengamatan Deformasi \nSetelah Menghilangkan Pengaruh Rotasi Blok Sunda pada Ve dan Vn dan Resultan :\nBMDU = 0,00601 (m/tahun) ; 0,00263(m/tahun)  dan 0,00656(m/tahun) \nBMSA = 0,00123(m/tahun) ; 0,00130(m/tahun) dan 0,00179(m/tahun) \nCPDU = 0,00150(m/tahun) ; 0,00039(m/tahun)  dan 0,00155(m/tahun) \nCPSA = 0,00977(m/tahun) ; 0,00715(m/tahun)  dan 0,01211(m/tahun) \n', '1. Dari hasil pengamatan dengan menggunakan GPS\npada bulan Maret, Mei dan Juni 2018 titik-titik\npengamatan mengalami perubahan koordinat\nsetiap bulannya. Nilai perubahan koordinat\nkartesian tiga dimensi terbesar pada bulan Juli\n2015 sampai dengan Juni 2018 adalah sebagai\nberikut n: -0,02471 m, e: 0,10821 m dan u:\n0,05623 m. Sedangkan untuk nilai perubahan\nkoordinat terkecil pada bulan Juli 2015 sampai\ndengan Juni 2018 adalah sebagai berikut n:\n0,00123 m, e: -0,00119 m dan u: -0,00088 m.\n2. Dari hasil pengolahan data pengamatan dapat\ndisimpulkan bahwa empat titik yang sama dari\npengamatan tahun 2015, 2016 dan 2018 secara\nnumeris mengalami pergeseran atau terjadi\ndeformasi, akan tetapi setelah dilakukan uji\nstatistik dengan menggunakan tingkat\nkepercayaan 95% keempat titik pengamatan tidak\nmengalami pergeseran yang cukup signifikan atau\ndapat dikatakan bahwa keempat titik tersebut\ntidak mengalami deformasi.', '1. Dengan metode survei GPS dual frequency yang\nmemiliki kemampuan untuk monitoring deformasi\npada ketelitian yang cukup tinggi, maka metode\nsurvei GPS untuk monitoring deformasi perlu\ndilanjutkan pada tahun-tahun berikutnya\n2. Pengamatan deformasi sebaiknya dilakukan secara\nkontinu agar dapat mengetahui kondisi deformasi\nyang terjadi pada lokasi pengamatan\n3. Guna memperoleh data yang lebih baik, sebaiknya\ndilakukan perencanaan survei yang lebih matang.\nMisalnya pemilihan titik yang berada di tempat\nterbuka, tidak banyak gangguan seperti pepohonan\nuntuk menghindari efek multipath\n4. Untuk proses pengolahan sebaiknya dipastikan\nterlebih dahulu data-data pendukung yang harus\ndiunduh telah tersedia lengkap sehingga proses\npengolahan tidak terganggu\n5. Sebaiknya dilakukan penentuan strategi pengolahan\nsecara cermat dan tepat sehingga hasil pengolahan\nyang diperoleh memiliki ketelitian yang tinggi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22453/20589', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(502, 'Kevin Dio Maldini', '21110114120006', 'Analisis Kesesuaian Ruang Terbuka Hijau Kota Magelang Menggunakan Sistem Informasi Geografis', 'Arief Laila Nugraha, S.T., M.Eng', 'Hana Sugiastu Firdaus, ST., MT', 'Kota Magelang', '33.71', 'Karto SIG', 2019, 'Data Jumlah Penduduk\nPeraturan Menteri PU No.5 2008\nPeta Administrasi Kota Magelang\nCitra Quicbird 2016\nData Taman\nPeta RTRW\nPeta Administrasi Kota Magelang\nPeta Jaringan Jalan Kota Magelang\nPeta Tata Guna Lahan Kota Magelang', 'Metode overlay', 'Luas RTH Publik Kota Magelang\nKlasifikasi dengan Luas (m2) yaitu \n- Taman = 317.435,13  m2\n- Lapangan = 476.454,88 m2\n- Makam = 373.376,29 m2\n- Jalur hijau jalan = 109.686,24 m2 \n- Hutan Kota = 765.361,99 m2\n- Jalur hijau listrik = 7.641,56 m2\n- Sempadan sungai = 170.959,65 m2\nLuas Total RTH Publik = 2.220.915,74 m2\n\nLuas RTH Privat Kota Magelang\nKlasifikasi Luas (m2) yaitu\n- Kebun 2.084.101,43 m2\n- Pekarangan 1.422.870,24 m2\nLuas Total RTH Privat 3.506.971,67 ', '1. Kota Magelang memiliki luas 18.530.453,79 m2 dan\nmemiliki 30,91% RTH dari luas total Kota\nMagelang atau dengan luas RTH sebesar\n5.727.887,42 m2 yang terdiri dari RTH publik\n11,99% atau dengan luas 2.220.915,74 m2 dan RTH\nprivat 18,93% atau dengan luas 3.506.971,67 m2.\nLuas RTH dari tiap Kecamatan Kota magelang yaitu\nKecamatan Magelang Utara memiliki RTH sebesar\n1.715.998,33 m2 atau 9,26%, Kecamatan Magelang\nTengah memiliki RTH sebesar 1.252.960,74 m2 atau\n6,76%, Kecamatan Magelang Selatan memiliki\nRTH sebesar 2.758.928,35 m2 atau 14,89%.\n2. Peraturan Menteri PU No.5/PRT/M/2008 yang\nmengatur tentang luasan Ruang Terbuka Hijau\nkawasan perkotaan yang mengharuskan luasan RTH\npada suatu kota sebesar 30% dari luasan Kota yang\nmana terdiri dari 20% RTH publik dan 10% RTH\nprivat. Kota Magelang memiliki luasan RTH\nsebesar 30,91 % (memenuhi) yang terdiri dari RTH\npublik sebesar 11,99 % (tidak memenuhi) dan RTH\nprivat sebesar 18,93% (memenuhi).\n3. Peraturan Menteri PU No.5/PRT/M/2008 juga\nmengatur tentang penyediaan Ruang Terbuka Hijau\nklasifikasi taman dari tiap kecamatan terhadap\njumlah penduduk dengan mengalikan antara jumlah\npenduduk yang dilayani dengan standar luas RTH\nper kapita sesuai peraturan yang berlaku. Hasil\nanalisis ini untuk tiap Kecamatan di Kota Magelang\nmemenuhi luasan minimal taman kecamatan\nberdasarkan Peraturan Menteri PU\nNo.5/PRT/M/2008.\n4. Pada penelitian ini didapatkan hasil digitasi RTH\nKota Magelang sebesar 5.727.887,42 m2 atau 30,91\n% dan RTH Kota Magelang pada Rencana Tata\nRuang Wilayah (RTRW) 1.926.991,03 m2 atau\n10,4%. Kesesuaian antara RTH hasil digitasi dengan\nRTH pada RTRW yang sesuai sebesar 1.778.888,45\nm2 sedangkan RTH yang tidak sesuai antara hasil\ndigitasi dengan RTH pada RTRW sebesar\n4.097.082,44 m2. Kecamatan Magelang Utara RTH\nyang sesuai sebesar 380.061,35 m2 dan RTH yang\ntidak sesuai sebesar 1.420.669,02 m2. Kecamatan\nMagelang Tengah RTH yang sesuai sebesar\n269.539,93 m2 dan RTH yang tidak sesuai sebesar\n1.020.061,13 m2. Kecamatan Magelang Selatan\nRTH yang sesuai sebesar 1.129.307,24 m2 dan RTH\nyang tidak sesuai sebesar 1.656.330,47 m2.', '1. Pada saat proses digitasi menggunakan acuan\nseperti peta Tata Guna Lahan agar dapat membantu\ninterpetasi visual.\n2. Sebaiknya lebih meningkatkan persebaran RTH\nyang masih kurang seperti RTH Publik agar dapat\nmemenuhi kebutuhan RTH di Kota Magelang dan\npemerataan RTH di setiap kecamatannya.\n3. Penelitian selanjutnya disarankan untuk\nmenggunakan citra resolusi tinggi dan terbaru agar\nkenampakan Ruang Terbuka Hijau tidak terlalu\nberbeda dengan keadaan di lapangan.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22465/20600', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(503, 'Indira Nori Kurniawan', '21110114120007', 'ANALISIS PENGARUH MULTIPATH DARI TOPOGRAFI TERHADAP PRESISI PENGUKURAN GNSS DENGAN METODE STATIK', 'Dr. L.M Sabri, ST., MT', 'Bandi Sasmito, ST., MT', 'Kota Semarang', '33.74', 'Terestris Hidro', 2019, 'a. Data 2 sesi pengukuran GNSS metode statik\nyang diperoleh pada tanggal 4 Juni 2018 pada\nDOY 155 selama 1 jam untuk tiap titik di tiap\nsesi\nb. Data CORS UDIP pada tanggal 4 Juni 2018\npada DOY 155 selama 1 hari ( 24 jam ).\nc. Data ketinggian atau kontur di setiap titik\nyang diukur menggunakan alat Total Station.', 'Metode Statik', 'Nilai Rata-rata Multipath (MP1 dan MP2) dalam Sesi 1 dan Sesi 2 yaitu\nO 1 Jam = 0,37125m ; 0,34960m ; 0,35762m ; 0,32157m\nS 1 Jam = 0,35515m ; 0,29068m ; 0,33357m ; 0,26290m\nO 20 Menit = 0,35922m ; 0,33116m ; 0,34298m ; 0,30161m\nS 20 Menit = 0,35396m ; 0,28419m ; 0,33435m ; 0,24693m\n\n Uji Statistik dengan Uji Fisher ( Uji F )\nNilai Presisi Horizontal Titik Observasi\nDan Titik Simulasi Dari Kedua Sesi Pengukuran Pada\nPengamatan 1 Jam\nBM 1 = 0,00158m ; 0,00168m\nBM 2 = 0,00139m ; 0,00172m\nBM 3 = 0,00144m ; 0,00170m\nBM 4 = 0,00144m ; 0,00176m\nBM 1 ( S ) = 0,00341m ; 0,00449m\nBM 2 ( S ) = 0,00334m ; 0,00413m\nBM 3 ( S ) = 0,00369m ; 0,00454m\nBM 4 ( S ) = 0,00383m ; 0,00459m\nRata-rata = 0,00251m ; 0.00307m', '1. Multipath dari topografi tidak mempengaruhi\npresisi horizontal pengukuran GNSS untuk\npengukuran dengan baseline rentang 2 km ? 3\nkm dibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran di sesi 1 maupun pengukuran di sesi\n2 baik pada titik observasi ataupun simulasi.\n2. Pengaturan anti multipath pada pengukuran tidak\nmempengaruhi presisi horizontal pengukuran\nGNSS untuk baseline rentang 2 km ? 3 km\ndibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran pada sesi 1 maupun pengukuran pada\nsesi 2.\n3. Penghilangan satelit pada data pengukuran tidak\nmempengaruhi presisi horizontal pengukuran\nGNSS untuk baseline rentang 2 km ? 3 km\ndibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran titik observasi dan juga titik simulasi.', '1. Perlu adanya kajian lebih lanjut mengenai efek\nmultipath dan pengaruhnya terhadap ketelitian\npengukuran.\n2. Perlu adanya kajian lebih lanjut mengenai\nanalisis multipath untuk pengukuran baseline\ndengan rentang yang jauh.\n3. Perlunya perencanan penentuan tempat yang\ntepat dengan menggunakan mission plan terlebih\ndahulu agar terdapat nilai multipath di lokasi\npengukuran.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22441/20577', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(504, 'Reza Al Arif Mulawarman', '21110114130080', 'Aplikasi Multibeam Echosounder NORBIT WBMS Untuk Penentuan Jalur Pelayaran (Studi Kasus: Teluk Awur, Kabupaten Jepara)', 'Bambang Darmo Yuwono, ST., MT', 'Dr. L.M Sabri, ST., MT', 'Kab. Jepara', '33.2', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22441/20577', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(505, 'Alfian Putra Setiadarma', '21110114190074', 'Analisis Pengaruh Data SYP (Sound Velocity Profiler) pada Hasil Pengolahan Data Multibeam Echosounder menggunakan Perangkat Lunak Eiva (Studi Kasus : Marine Station Teluk Awur, Jepara)', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Dr. L.M Sabri, ST., MT', 'Kab. Jepara', '33.2', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22441/20577', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(506, 'Muhammad Annis Wichi Luthfina', '21110114140073', 'Analisis Kesesuaian Penggunaan Lahan Terhadap Rencana Tata Ruang Wilayah Tahun 2010-2030 menggunakan Sistem Informasi Geografis di Kecamatan Pati', 'Andri Suprayogi, ST., MT', 'Ir. Sawitri Subiyanto, M.Si', 'Kab. Pati', '33.18', 'Pertanahan Kewilayahan', 2019, '1. Foto Udara UAV\n2. Data GPS GCP\n3. Data GPS CORS UNDIP', 'GPS Metode Statik, \nMetode Perhitungan CE90 dan LE90', 'RMSE Horisontal GCP adalah 0,04315 m dengan ketelitian orthorektifikasi memenuhi standar kelas II\nRMSE Vertikal GCP adalah 0,027456642 m dengan ketelitian proses orthoretifikasi memenuhi standar kelas I\n\nHasil RMSE horizontal ICP adalah 5,779525315 cm sedangkan RMSE vertikal ICP adalah  3,372661692 cm\n\nUji Ketelitian Peta CE90 adalah 0,0877 m dan LE90 adalah 0,0556 m', '1.) Hasil analisis tingkat kualitas peta desa yang meliputi RW 04 dan RW 08 Kelurahan Tembalang terhadap ketentuan peraturan Perka BIG NO. 15 Tahun 2014 dengan validasi geometri horizontal dan validasi geometri vertikal maka dilakukan perhitungan CE90 dan LE90. Hasil nilai CE90 yang didapat adalah 0,0877 m dan hadil\nnilai LE90 yang didapat adalah 0,0556 yang mana dengan demikian nilai yang dihasilkan tersebut memenuhi standar ketelitian peta dasar dengan ketelitian horizontal kelas 1 secara vertical maupun horizontal untuk peta skala 1:1.000 yaitu kurang dari 0,20 m.\n2.) Dengan terapan teknologi UAV dan SIG dapat diterapkan dalam metode pembuatan peta desa karena memiliki hasil standar akurasi geometri yang baik. Mengidentifikasi deliniasi batas, jalan, sungai, luas area yang\nterdiri dari beberapa RW, RT dan sarana prasarana yang ada. Menghasilkan peta batas wilayah, peta sarana dan prasarana.', '1. Apabila pengolahan data foto udara menggunakan software Agisoft Photoscan, maka sebelum melakukan pengambilan data harus membaca buku panduan darisoftware tersebut karena akan sangat membantu untuk teknik pelaksanaan dari pengambilan data hingga ke pengolahan.\n2. Pemotretan foto udara menggunakan UAV untuk dilakukan dari ketinggian\nyang sama. Hal tersebut agar antar foto udara yang diambil dari waktu yang\nberbeda memiliki keseragaman. \n3. Pada pemotretan dengan UAV, tinggi terbang UAV diusahakan serendah\nmungkin dan tetap memperhatikan tinggi obstacle agar resolusi yang didapatkan dapat secara maksimal dan nilai sidelap, overlap dibuat tinggi agar tidak terjadi lubang data karena kurangnya pertampalan.\n4. Penentuan posisi titik GCP untuk mempertimbangkan kondisi obstruksi pengamatan GPS. Hindari penempatan titik GCP pada tempat yang terdapat\ngangguan interferensi elektris dan juga multipath.\n5. Pengamatan GPS untuk titik GCP harap untuk dilakukan dalam waktu yang lebih lama dan menggunakan lebih banyak titik GCP. Karena GCP berperan penting dalam pembentukan DEM, yaitu pada tahap orthorektifikasi sehingga diharapkan DEM yang terbentuk memiliki akurasi posisi X, Y, dan Z yang bagus.\n6. Melakukan validasi untuk geometri horizontal dan vertikal dalam jumlah\nobjek yang lebih banyak dan menyebar agar kualitas validasi lebih baik.\n7. Untuk mendapatkan hasil yang maksimal, pengolahan dilakukan dengan\nmenggunakan opsi high agar tidak terjadi penurunan kualitas data dari hasil report.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22441/20577', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(507, 'David Beta Putra', '21110114190088', 'Analisis Kerawanan Banjir Pada Kawasan Terbangun Berdasarkan Klasifikasi Indeks EBBI (Enhanced Built-Up And Bareness Index) Menggunakan SIG\n(Studi Kasus di Kabupaten Demak)', 'Ir. Bambang Sudarsono, MS', 'Arief Laila Nugraha, ST., M.Eng', 'Kab. Demak', '33.21', 'Fotri Inderaja', 2019, '1 Citra Satelit Landsat-8 tahun 2017\n2 Curah Hujan tahun 2017\n3 DEM Terrasar-X tahun 2011\n4 Jenis tanah tahun 2011\n5 Jaringan sungai tahun 2011\n6 Tata guna lahan tahun 2011\n7. Data banjir tahun 2015', 'Metode EBBI\nMetode AHP\nMetode IDW', 'parameter yang memiliki\nbobot tertinggi adalah kerapatan sungai yang memiliki\nnilai bobot sebesar 37% dari keseluruhan kriteria.\nParameter lain yang memiliki bobot menonjol\ndibanding dengan parameter lainnya yaitu jarak dari\nsungai sebesar 29% dan curah hujan sebesar 18%.\nSehingga dapat ditarik kesimpulan bahwa ketiga\nparameter ini adalah parameter yang paling dominan\ndalam menentukan daerah rawan banjir di Kabupaten\nDemak. Hal ini disebabkan karena rata-rata kejadian\nbanjir di Kabupaten Demak terjadi karena adanya\nluapan sungai dan banjir kiriman dari daerah lain\nmelalui aliran sungai saat terjadi hujan deras. Adanya\nluapan sungai dan banjir kiriman tersebut berasal dari\nsungai-sungai yang mengalir di sepanjang Kabupaten Demak, sehingga ketiga parameter ini sangat\nberpengaruh dalam menentukan daerah rawan banjir.\n\n\nKawasan Terbangun Rawan Banjir\nLuasan Kawasan Terbangun (ha) yaitu\n1.) 628,113  dengan tingkat kerawanan rendah 4,22 % \n2.) 5.108,351 dengan tingkat kerawanan sedang 34,30\n3.) 9.158,762 dengan tingkat kerawanan  tinggi 61,49', 'Tingkat kerawanan banjir di Kabupaten\nDemak dibedakan menjadi 3 kelas yaitu\nkelas kerawanan rendah, sedang dan tinggi.\nArea luasan kerawanan banjir pada kelas\nrendah sebesar 5.114,217 ha atau dengan\npresentase 5,10%. Selanjutnya area luasan\nkerawanan banjir pada kelas sedang sebesar\n32.361,365 ha atau dengan presentase\n32,37% dan luasan kerawanan banjir pada\nkelas tinggi sebesar 62.799,751 atau dengan\npresentase 62,64%. Secara umum\nkerawanan banjir di Kabupaten Demak\ndidominasi oleh kelas tinggi karena Demak\nterletak pada daerah yang dekat dengan\nsungai dan memiliki topografi yang lebih\nrendah dari daerah di sekitarnya sehingga\njika ada hujan yang lebat Demak cenderung\nbanjir karena menerima banjir kiriman\nakibat luapan sungai dari daerah lain.\n2. Kawasan terbangun yang diperoleh\nberdasarkan indeks EBBI berjumlah\n165.647 pixel atau jika dihitung luasannya\nberjumlah 14.895,225 ha. Jumlah kawasan\nterbangun paling banyak terdapat di\nkecamatan Wedung dengan luas sebesar\n2.355,970 ha. Sedangkan jumlah kawasan\nterbangun paling sedikit terdapat di\nkecamatan Kebonagung dengan luas sebesar\n198,396 ha. presentase terbesar antara\nluasan kawasan terbangun dengan luas\nwilayah terdapat di kecamatan Mranggen\ndengan presentase sebesar 31,13%. Dapat\nditarik kesimpulan bahwa di kecamatan\nMranggen, jumlah luasan kawasan\nterbangun dianggap paling dominan\nterhadap luas wilayah jika dibandingkan\ndengan kecamatan lain karena memiliki\npresentase terbesar. Adapun kecamatan\ndengan presentase terkecil antara luasan\nkawasan terbangun dengan luas wilayah\nterdapat di kecamatan Kebonagung dengan\npresentase sebesar 4,41%. Hal ini\nmenunjukkan bahwa meskipun jumlah\nluasan kawasan terbangun paling banyak\nterdapat di kecamatan Wedung, akan tetapi\njumlah luasan tersebut tidak dominan\nterhadap luas wilayah kecamatan Wedung\ndimana presentase terhadap luas wilayah\nhanya menunjukkan nilai sebesar 9,52%.\n3. Hasil overlay kawasan terbangun dengan\nkerawanan banjir menunjukkan 628,113 ha\nkawasan terbangun masuk dalam kelas\nkerawanan banjir rendah atau dengan\npresentase 4,22%. Selanjutnya kawasan\nterbangun yang masuk dalam kelas\nkerawanan banjir sedang sebesar 5.108,351\ndengan presentase 34,30% dan kawasan\nterbangun yang masuk dalam kelas\nkerawanan banjir tinggi sebesar 9.158,762\nha dengan presentase 61,49%. Adapun\nkesesuaian hasil pengolahan dilihat dari 2\nmacam validasi yaitu validasi dengan data\nBPBD dan validasi lapangan. Validasi data\nBPBD digunakan untuk melihat kesesuaian\ndaerah rawan banjir dimana dari 14\nkecamatan terdapat 4 kecamatan yang tidak\nsesuai sehingga presentase kesesuaian\ndaerah rawan banjir sebesar 71,42% Validasi di lapangan digunakan untuk\nmelihat kesesuaian pengolahan kawasan\nterbangun dan kesesuaian pengolahan\nkawasan terbangun yang masuk kedalam\nkelas kerawanan banjir. Validasi kawasan\nterbangun sendiri menunjukkan kesesuaian\nsebesar 85,71% dimana dari 70 titik sampel,\n60 titik sesuai dan 10 titik tidak sesuai\ndengan hasil pengolahan. Validasi kawasan\nterbangun rawan banjir sendiri\nmenunjukkan kesesuaian sebesar 72,86%\ndimana 51 titik sesuai dan 19 titik tidak\nsesuai dengan hasil pengolahan', '1. Pengolahan kerawanan banjir sebaiknya\nmenggunakan data parameter kerawanan\nbanjir terbaru sehingga mendapatkan hasil\nyang terbaru juga.\n2. Untuk penelitian selanjutnya dalam\nmenentukan bobot parameter kerawanan\nbanjir sebaiknya lebih dipertimbangkan lagi\ntingkat kepentingan antar parameter agar\nhasil pengolahan semakin sesuai dengan\nkondisi di lapangan.\n3. Pengolahan data curah hujan sebaiknya\ndilakukan dengan 2 metode yaitu polygon\nthiessen dan griding sehingga dapat\nmembandingkan metode mana yang lebih\nbaik untuk mengolah data curah hujan yang\ndisesuaikan dengan kondisi topografi\nwilayah penelitian.\n4. Pengolahan kawasan terbangun sebaiknya\nmenggunakan software versi terbaru atau\ndapat melakukan pengolahan dengan\nsoftware lain agar dapat melihat\nperbandingan dari hasil pengolahan.\n5. Pengolahan kawasan terbangun sebaiknya\ndapat dilakukan dengan menggunakan\nindeks lain seperti NDBI, UI dan NBLI atau\ndapat dikombinasikan dengan indeks\nvegetasi seperti NDVI untuk mendapatkan\nhasil kawasan terbangun yang lebih akurat.\n6. Penentuan rentang kawasan terbangun\nsebaiknya ditentukan secara spesifik\nberdasarkan threshold hasil histogram citra.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22464/20599', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(508, 'Ghazian Hazazi', '21110114120014', 'Analisis Perubahan Garis Pantai Terhadap Eksistensi Mangrove  Menggunakan Penginderaan Jauh dan Aplikasi Digital Shoreline Analysis System (DSAS) Tahun 2014-2018 (Studi Kasus : Kabupaten Kendal)', 'Hana Sugiastu Firdaus, ST., MT', 'Abdi Sukmono, ST., MT', 'Kab. Kendal', '33.24', 'Fotri Inderaja', 2019, 'Data Pengukuran GPS Tahun 2015\nData Pengukuran GPS Tahun 2016\nData Pengukuran GPS Tahun 2018', 'metode pengamatan GPS statik\nmetode linier fit\n', 'Nilai Kecepatan Titik Pengamatan Deformasi \nSetelah Menghilangkan Pengaruh Rotasi Blok Sunda pada Ve dan Vn dan Resultan :\nBMDU = 0,00601 (m/tahun) ; 0,00263(m/tahun)  dan 0,00656(m/tahun) \nBMSA = 0,00123(m/tahun) ; 0,00130(m/tahun) dan 0,00179(m/tahun) \nCPDU = 0,00150(m/tahun) ; 0,00039(m/tahun)  dan 0,00155(m/tahun) \nCPSA = 0,00977(m/tahun) ; 0,00715(m/tahun)  dan 0,01211(m/tahun) \n', '1. Dari hasil pengamatan dengan menggunakan GPS\npada bulan Maret, Mei dan Juni 2018 titik-titik\npengamatan mengalami perubahan koordinat\nsetiap bulannya. Nilai perubahan koordinat\nkartesian tiga dimensi terbesar pada bulan Juli\n2015 sampai dengan Juni 2018 adalah sebagai\nberikut n: -0,02471 m, e: 0,10821 m dan u:\n0,05623 m. Sedangkan untuk nilai perubahan\nkoordinat terkecil pada bulan Juli 2015 sampai\ndengan Juni 2018 adalah sebagai berikut n:\n0,00123 m, e: -0,00119 m dan u: -0,00088 m.\n2. Dari hasil pengolahan data pengamatan dapat\ndisimpulkan bahwa empat titik yang sama dari\npengamatan tahun 2015, 2016 dan 2018 secara\nnumeris mengalami pergeseran atau terjadi\ndeformasi, akan tetapi setelah dilakukan uji\nstatistik dengan menggunakan tingkat\nkepercayaan 95% keempat titik pengamatan tidak\nmengalami pergeseran yang cukup signifikan atau\ndapat dikatakan bahwa keempat titik tersebut\ntidak mengalami deformasi.', '1. Dengan metode survei GPS dual frequency yang\nmemiliki kemampuan untuk monitoring deformasi\npada ketelitian yang cukup tinggi, maka metode\nsurvei GPS untuk monitoring deformasi perlu\ndilanjutkan pada tahun-tahun berikutnya\n2. Pengamatan deformasi sebaiknya dilakukan secara\nkontinu agar dapat mengetahui kondisi deformasi\nyang terjadi pada lokasi pengamatan\n3. Guna memperoleh data yang lebih baik, sebaiknya\ndilakukan perencanaan survei yang lebih matang.\nMisalnya pemilihan titik yang berada di tempat\nterbuka, tidak banyak gangguan seperti pepohonan\nuntuk menghindari efek multipath\n4. Untuk proses pengolahan sebaiknya dipastikan\nterlebih dahulu data-data pendukung yang harus\ndiunduh telah tersedia lengkap sehingga proses\npengolahan tidak terganggu\n5. Sebaiknya dilakukan penentuan strategi pengolahan\nsecara cermat dan tepat sehingga hasil pengolahan\nyang diperoleh memiliki ketelitian yang tinggi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22442/20578', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(509, 'Rahmat Randy Valdika', '21110114130067', 'Analisis Ancaman Multi Bencana di Kabupaten Kendal Berbasis Fuzzy Analytic Hierarchy Process', 'Hana Sugiastu Firdaus, ST., MT', 'Nurhadi Bashit, ST., M.Eng', 'Kab. Kendal', '33.24', 'Karto SIG', 2019, 'Data Jumlah Penduduk\nPeraturan Menteri PU No.5 2008\nPeta Administrasi Kota Magelang\nCitra Quicbird 2016\nData Taman\nPeta RTRW\nPeta Administrasi Kota Magelang\nPeta Jaringan Jalan Kota Magelang\nPeta Tata Guna Lahan Kota Magelang', 'Metode overlay', 'Luas RTH Publik Kota Magelang\nKlasifikasi dengan Luas (m2) yaitu \n- Taman = 317.435,13  m2\n- Lapangan = 476.454,88 m2\n- Makam = 373.376,29 m2\n- Jalur hijau jalan = 109.686,24 m2 \n- Hutan Kota = 765.361,99 m2\n- Jalur hijau listrik = 7.641,56 m2\n- Sempadan sungai = 170.959,65 m2\nLuas Total RTH Publik = 2.220.915,74 m2\n\nLuas RTH Privat Kota Magelang\nKlasifikasi Luas (m2) yaitu\n- Kebun 2.084.101,43 m2\n- Pekarangan 1.422.870,24 m2\nLuas Total RTH Privat 3.506.971,67 ', '1. Kota Magelang memiliki luas 18.530.453,79 m2 dan\nmemiliki 30,91% RTH dari luas total Kota\nMagelang atau dengan luas RTH sebesar\n5.727.887,42 m2 yang terdiri dari RTH publik\n11,99% atau dengan luas 2.220.915,74 m2 dan RTH\nprivat 18,93% atau dengan luas 3.506.971,67 m2.\nLuas RTH dari tiap Kecamatan Kota magelang yaitu\nKecamatan Magelang Utara memiliki RTH sebesar\n1.715.998,33 m2 atau 9,26%, Kecamatan Magelang\nTengah memiliki RTH sebesar 1.252.960,74 m2 atau\n6,76%, Kecamatan Magelang Selatan memiliki\nRTH sebesar 2.758.928,35 m2 atau 14,89%.\n2. Peraturan Menteri PU No.5/PRT/M/2008 yang\nmengatur tentang luasan Ruang Terbuka Hijau\nkawasan perkotaan yang mengharuskan luasan RTH\npada suatu kota sebesar 30% dari luasan Kota yang\nmana terdiri dari 20% RTH publik dan 10% RTH\nprivat. Kota Magelang memiliki luasan RTH\nsebesar 30,91 % (memenuhi) yang terdiri dari RTH\npublik sebesar 11,99 % (tidak memenuhi) dan RTH\nprivat sebesar 18,93% (memenuhi).\n3. Peraturan Menteri PU No.5/PRT/M/2008 juga\nmengatur tentang penyediaan Ruang Terbuka Hijau\nklasifikasi taman dari tiap kecamatan terhadap\njumlah penduduk dengan mengalikan antara jumlah\npenduduk yang dilayani dengan standar luas RTH\nper kapita sesuai peraturan yang berlaku. Hasil\nanalisis ini untuk tiap Kecamatan di Kota Magelang\nmemenuhi luasan minimal taman kecamatan\nberdasarkan Peraturan Menteri PU\nNo.5/PRT/M/2008.\n4. Pada penelitian ini didapatkan hasil digitasi RTH\nKota Magelang sebesar 5.727.887,42 m2 atau 30,91\n% dan RTH Kota Magelang pada Rencana Tata\nRuang Wilayah (RTRW) 1.926.991,03 m2 atau\n10,4%. Kesesuaian antara RTH hasil digitasi dengan\nRTH pada RTRW yang sesuai sebesar 1.778.888,45\nm2 sedangkan RTH yang tidak sesuai antara hasil\ndigitasi dengan RTH pada RTRW sebesar\n4.097.082,44 m2. Kecamatan Magelang Utara RTH\nyang sesuai sebesar 380.061,35 m2 dan RTH yang\ntidak sesuai sebesar 1.420.669,02 m2. Kecamatan\nMagelang Tengah RTH yang sesuai sebesar\n269.539,93 m2 dan RTH yang tidak sesuai sebesar\n1.020.061,13 m2. Kecamatan Magelang Selatan\nRTH yang sesuai sebesar 1.129.307,24 m2 dan RTH\nyang tidak sesuai sebesar 1.656.330,47 m2.', '1. Pada saat proses digitasi menggunakan acuan\nseperti peta Tata Guna Lahan agar dapat membantu\ninterpetasi visual.\n2. Sebaiknya lebih meningkatkan persebaran RTH\nyang masih kurang seperti RTH Publik agar dapat\nmemenuhi kebutuhan RTH di Kota Magelang dan\npemerataan RTH di setiap kecamatannya.\n3. Penelitian selanjutnya disarankan untuk\nmenggunakan citra resolusi tinggi dan terbaru agar\nkenampakan Ruang Terbuka Hijau tidak terlalu\nberbeda dengan keadaan di lapangan.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22468/20603', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(510, 'Sabda Lestari', '21110114130050', 'Pemetaan Risiko Tanah Longsor Kabupaten Semarang Berbasis Sistem Informasi Geografis', 'Hana Sugiastu Firdaus, ST., MT', 'Moehammad Awaluddin, S.T., M.T', 'Kab. Semarang', '33.22', 'Karto SIG', 2019, 'a. Data 2 sesi pengukuran GNSS metode statik\nyang diperoleh pada tanggal 4 Juni 2018 pada\nDOY 155 selama 1 jam untuk tiap titik di tiap\nsesi\nb. Data CORS UDIP pada tanggal 4 Juni 2018\npada DOY 155 selama 1 hari ( 24 jam ).\nc. Data ketinggian atau kontur di setiap titik\nyang diukur menggunakan alat Total Station.', 'Metode Statik', 'Nilai Rata-rata Multipath (MP1 dan MP2) dalam Sesi 1 dan Sesi 2 yaitu\nO 1 Jam = 0,37125m ; 0,34960m ; 0,35762m ; 0,32157m\nS 1 Jam = 0,35515m ; 0,29068m ; 0,33357m ; 0,26290m\nO 20 Menit = 0,35922m ; 0,33116m ; 0,34298m ; 0,30161m\nS 20 Menit = 0,35396m ; 0,28419m ; 0,33435m ; 0,24693m\n\n Uji Statistik dengan Uji Fisher ( Uji F )\nNilai Presisi Horizontal Titik Observasi\nDan Titik Simulasi Dari Kedua Sesi Pengukuran Pada\nPengamatan 1 Jam\nBM 1 = 0,00158m ; 0,00168m\nBM 2 = 0,00139m ; 0,00172m\nBM 3 = 0,00144m ; 0,00170m\nBM 4 = 0,00144m ; 0,00176m\nBM 1 ( S ) = 0,00341m ; 0,00449m\nBM 2 ( S ) = 0,00334m ; 0,00413m\nBM 3 ( S ) = 0,00369m ; 0,00454m\nBM 4 ( S ) = 0,00383m ; 0,00459m\nRata-rata = 0,00251m ; 0.00307m', '1. Multipath dari topografi tidak mempengaruhi\npresisi horizontal pengukuran GNSS untuk\npengukuran dengan baseline rentang 2 km ? 3\nkm dibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran di sesi 1 maupun pengukuran di sesi\n2 baik pada titik observasi ataupun simulasi.\n2. Pengaturan anti multipath pada pengukuran tidak\nmempengaruhi presisi horizontal pengukuran\nGNSS untuk baseline rentang 2 km ? 3 km\ndibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran pada sesi 1 maupun pengukuran pada\nsesi 2.\n3. Penghilangan satelit pada data pengukuran tidak\nmempengaruhi presisi horizontal pengukuran\nGNSS untuk baseline rentang 2 km ? 3 km\ndibuktikan dari hasil uji Fisher tidak adanya\nperbedaan yang signifikan dari presisi horizontal\npengukuran titik observasi dan juga titik simulasi.', '1. Perlu adanya kajian lebih lanjut mengenai efek\nmultipath dan pengaruhnya terhadap ketelitian\npengukuran.\n2. Perlu adanya kajian lebih lanjut mengenai\nanalisis multipath untuk pengukuran baseline\ndengan rentang yang jauh.\n3. Perlunya perencanan penentuan tempat yang\ntepat dengan menggunakan mission plan terlebih\ndahulu agar terdapat nilai multipath di lokasi\npengukuran.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22477/20608', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(511, 'Iqbal Yukha Nur Afani', '21110114120030', 'Optimalisasi Pembuatan Peta Topografi Skala 1:1000 Menggunakan Kombinasi Data Pengukuran Terestris dan Foto Udara Format Kecil', 'Nurhadi Bashit, ST., M.Eng', 'Andri Suprayogi, ST., MT', 'Kab. Lamongan', '35.24', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22555/20672', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(512, 'Muhammad Asadullah A', '21110113190102', 'Analisis Perbandingan Peningkatan Sedimentasi di Waduk Mrica dengan Perubahan Tutupan Lahan Pada Daerah Aliran Sungai (DAS) Merawu Menggunakan Data Citra Satelit Landsat (Studi Kasus : Kabupaten Banjarnegara, Jawa Tengah)', 'Nurhadi Bashit, ST., M.Eng', 'Andri Suprayogi, ST., MT', 'Kab. Banjarnegara', '33.04', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22757/20805', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(513, 'Wahyu Gangga', '21110114140091', 'Analisis Ketelitian Pengukuran Garis Pantai Metode GPS-RTK (GNSS Tracking) dan Metode Total Station', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Bandi Sasmito, ST., MT', 'Kab. Jepara', '33.2', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22467/20602', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(514, 'Reza Nur Hidayat', '21110114130057', 'Analisis Desain Jaring GNSS berdasarkan Fungsi Presisi (Studi Kasus : Titik Geoid Geometri Kota Semarang)', 'M. Awaluddin, ST., MT', 'Ir. Bambang Sudarsono, MS', 'Kota Semarang', '33.74', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22451/20587', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(515, 'Billy Silaen', '21110114120017', 'Analisis Komparasi Model 3 Dimensi Fotogrametri Rentang Dekat Terhadap Cetakan 3 Dimensi Dengan Teknologi Cetak Raise3D N2 Plus', 'Nurhadi Bashit, ST., M.Eng', 'Ir. Sawitri Subiyanto, M.Si', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22475/20606', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(516, 'Wildan Ryan Irfana', '21110114130070', 'Pembuatan Aplikasi Peta Rute Bus Rapid Transit (BRT) Kota Semarang Berbasis Mobile GIS Menggunakan Smartphone Android', 'Moehammad Awaluddin, S.T., M.T', 'Bambang Darmo Yuwono, ST., MT', 'Kota Semarang', '33.74', 'Karto SIG', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22560/20677', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(517, 'Nurrahmawati', '21110114120039', 'Visualisasi Peta Wisata dan Fasilitas Penunjang di Kabupaten Temanggung Menggunakan Aplikasi Carrymap (Studi Kasus : Posong, Pikatan Water Park, dan Taman Kartini Kowangan)', 'Hana Sugiastu Firdaus, ST., MT', 'Ir. Bambang Sudarsono, MS', 'Kab. Temanggung', '33.23', 'Karto SIG', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22466/20601', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
