(518, 'Kurniawan Adi Widiyanto', '21110114120010', 'Analisis Desain Jaring GNSS Berdasarkan Fungsi Kehandalan Internal dan Kehandalan Eksternal (Studi Kasus Titik Geoid Geometri Kota Semarang)', 'M. Awaluddin, ST., MT', 'Bambang Darmo Yuwono, ST., MT', 'Kota Semarang', '33.74', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22557/20674', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(519, 'Naufal Ilyas A', '21110114140098', 'Kajian Akurasi Citra Satelit Worldview 4 Pada Pembuatan Peta Dasar Pendaftaran Tanah (Studi Kasus: Lokasi PTSL Desa Ngampel, Mejayan, Madiun 2018)', 'Abdi Sukmono, ST., MT', 'Ir. Sawitri Subiyanto, M.Si', 'Kab. Madiun', '35.19', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22588/20698', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(520, 'Ade Naufalita', '21110114120032', 'Analisis Perubahan Zona Nilai Tanah dan Perubahan Penggunaan Lahan Pada Daerah Genangan Banjir Rob Kecamatan Pekalongan Utara Tahun 2014-2018\n\n', 'Sawitri Subiyanto, Ir., M.Si.', 'Ir. Hani\'ah, M.Si', 'Kota Pekalongan ', '33.75', 'Pertanahan Kewilayahan', 2019, 'Data Primer\na. Data harga transaksi dan penawaran tanah tahun 2018 dari survei lapangan yang dilakukan pada 14 Mei sampai 31 Juli 2018.\nb. Data batas genangan banjir rob Kota Pekalongan tahun 2018 dari survei lapangan yang dilakukan pada 14 Mei sampai 31 Juli 2018\nData Sekunder\na. Citra Worldview-2 akuisisi 2014 terkoreksi dari BAPPEDA Kota Pekalongan.\nb. Citra Google Earth Kecamatan Pekalongan Utara tahun 2018 dari download SAS.Planet.exe.\nc. Peta administrasi Kota Pekalongan tahun 2016 dari BAPPEDA Kota Pekalongan.\nd. Peta jaringan jalan dan sungai Kota Pekalongan tahun 2017 dari BAPPEDA Kota Pekalongan.\ne. Peta zona nilai tanah Kota Pekalongan tahun 2014 dari Kantor Pertanahan Kota Pekalongan.\nf. Peta daerah genangan banjir rob Kota Pekalongan tahun 2014 dari Penelitian yang dilakukan oleh Artiningsih tahun 2018.', 'Metode overlay\nMetode interpretasi digitasi on screen', '1. Tahun 2014 hingga 2018 terdapat 5 kelurahan yang wilayahnya tergenang banjir rob, yaitu Kelurahan Padukuhan Kraton, Bandengan, Panjang Wetan, Panjang Baru dan Kandang Panjang. Dan terdapat 3 klasifikasi perubahan penggunaan lahan pada daerah genangan banjir rob yaitu, perubahan penggunaan lahan dari tambak ke rawa, lahan kosong ke rawa dan lahan kosong ke permukiman dengan luas perubahan penggunaan lahan total sebesar 843.153 m2. Perubahan penggunaan lahan terbesar merupakan perubahan penggunaan lahan tambak ke rawa. Sehingga dapat disimpulkan bahwa adanya genangan banjir rob di Kecamatan Pekalongan Utara mempengaruhi perubahan penggunaan lahannya.\n2. Kaitan perubahan ZNT akibat perubahan penggunaan lahan di Kecamatan Pekalongan Utara\nkurun waktu tahun 2014-2018 kenaikan terbesar adalah 145,81% yang terletak pada titik perubahan\n4 yang mengalami perubahan penggunaan lahan tambak ke rawa. Titik perubahan 4 berada di\nselatan Jalan Raya Jeruk Sari dan berada pada perbatasan antara Kota Pekalongan dengan\nKabupaten Pekalongan. Sedangkan penurunan zona nilai tanah terbesar adalah -42,22% yang\nterletak pada titik perubahan 8 yang mengalami perubahan penggunaan lahan kosong ke rawa. Titik perubahan 8 ini berada pada Jalan Kunti Utara seberang SD N Kandang Panjang 10. Perubahan\nZNT pada daerah genangan banjir rob hasil penelitian ini kurang dipengaruhi oleh perubahan\npenggunaan lahan dan lebih dipengaruhi oleh faktor lain seperti aksesibilitas hingga adanya\nfasilitas umum disekitar.', '1. Dalam penentuan titik sampel sebaiknya pada lokasi yang mudah terjangkau sehingga tidak\nkesulitan dalam survei lapangan.\n2. Dalam penentuan zona sebaiknya memperhatikan batas administrasinya guna mempermudah\nanalisis.\n3. Untuk penelitian berikutnya dapat dilakukan pemodelan genangan banjir rob dengan menggunakan data pasang surut air laut dan data ketinggian muka tanah sehingga didapatkan model geangan banjir rob yang lebih akurat.\n4. Dalam penelitian perubahan zona nilai tanah sebaiknya menggunakan poligon zona tahun awal\ndengan tahun akhir yang sama untuk mempermudah analisisnya.', '1. Dalam penentuan titik sampel sebaiknya pada lokasi yang mudah terjangkau sehingga tidak kesulitan dalam survei lapangan.\n2. Dalam penentuan zona sebaiknya memperhatikan batas administrasinya guna mempermudah analisis.\n3. Untuk penelitian berikutnya dapat dilakukan pemodelan genangan banjir rob dengan menggunakan data pasang surut air laut dan data ketinggian muka tanah sehingga didapatkan model geangan banjir rob yang lebih akurat.\n4. Dalam penelitian perubahan zona nilai tanah sebaiknya menggunakan poligon zona tahun awal dengan tahun akhir yang sama untuk mempermudah analisisnya.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22450/20586', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(521, 'Oki Samuel Damanik', '21110114120023', 'Analisis Pengaruh Perubahan Garis Pantai Terhadap Pengelolaan Wilayah Laut Daerah Kabupaten Pekalongan dan Kota Pekalongan ', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Abdi Sukmono, ST., MT', 'Kab. Pekalongan', '33.26', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22443/20579', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(522, 'Khairuddin', '21110114130086', 'Analisis Hasil Pengolahan Titik Pengamatan CORS BIG Menggunakan Ultra-Rapid, Rapid Dan Final Ephemeris untuk Pengamatan Deformasi', 'M. Awaluddin, ST., MT', 'Fauzi Janu Amarrohman, ST., M.Eng', 'Kota Semarang', '33.74', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22556/20673', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(523, 'Mohamad Jorgie Prasetyo', '21110114120018', 'Pemetaan Jenis Sedimen Dengan Menggunakan Analisis Data Kedalaman dari Norbit IWBMS Multibeam Echosounder System (MBES)', 'Fauzi Janu Amarrohman, ST., M.Eng.', 'Hana Sugiastu Firdaus, ST., MT', 'Kab. Jepara', '33.2', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22587/20697', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(524, 'Mutiara Jamilah', '21110114120002', 'Potensi Tambang Batubara Berdasarkan Analisis Kelimpahan Mineral Batubara Menggunakan Citra Hyperion Eo-1 Dan Citra Landsat di Kota Sawahlunto', 'Abdi Sukmono, ST., MT', 'Hana Sugiastu Firdaus, ST., MT', 'Kota Sawahlunto', '13.73', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22558/20675', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(525, 'Ibrohim Shiddiq', '21110112140039', 'Desain Pengembangan Aplikasi Sistem Informasi Pedagang Pasar Berbasis GIS Dekstop (Studi Kasus : Pasar Bintoro kabupaten Demak)', 'Arief Laila Nugraha, S.T., M.Eng', 'Andri Suprayogi, ST., MT', 'Kab. Demak', '33.21', 'Karto SIG', 2019, '1.) Data kios lantai 1 dan 2 Pasar Bintoro\n2.) fasilitas umum lantai 1 dan 2 Pasar Bintoro\n3.) Akses jalan lantai 1 dan lantai 2 Pasar Bintoro\n\nData atribut kios yang berisi informasi nama pedagang, alamat pedagang, jenis dagangan, dan luas tiap kios.', '', 'Hasil visual berupa gambar. Untuk lebih jelasnya bisa lihat pada jurnal', '1. Berdasarkan data pedagang kios di Pasar Bintoro maka dapat dilakukan pemetaan dan pendataan informasi pedagang secara lengkap. Pemetaan dilakukan berdasarkan acuan dari data denah pasar yang tersedia dan validasi langsung di lapangan. Sedangkan pendataan informasi pedagang mengacu pada database yang tersedia di kantor pasar. Kemudian integrasi antara data informasi pedagang pasar dan data spasial dapat dilakukan dengan mudah, dan menghasilkan file berekstensi *.shp.\n2. Aplikasi SIG Pasar Bintoro berbasis desktop yang dibuat menggunakan aplikasi bahasa pemrograman Visual Studio 2015 berjalan lancar karena dibantu dengan tambahan kontrol dari\ndotSpatial untuk mendukung desain pengembangan aplikasi agar dapat menampilkan data spasial dan mengolah informasi di dalamnya.\nTahapan pembuatan aplikasi meliputi persiapan data, pengolahan data spasial dan data atribut,\nintegrasi data spasial dan data atribut menjadi file .shp, desain aplikasi, kemudian integrasi .shp yang telah dibuat ke dalam aplikasi yang telah didesain. Agar aplikasi dapat digunakan dengan mudah (user friendly) maka harus mempunyai alur kerja yang jelas dan mempunyai desain antar muka (user interface) yang simpel sehingga mendukung dan mempermudah pengguna dalam mengoperasikan aplikasi tersebut.\n3. Aplikasi memiliki beberapa kelebihan namun juga memiliki beberapa kekurangan. Sejauh ini aplikasi dapat berjalan dan berfungsi dengan baik karena kekurangan yang terdapat di dalam aplikasi tertutupi oleh kelebihan yang ada. Selain itu kekurangan aplikasi tidak berpengaruh terhadap data-data yang tersajikan di dalam aplikasi, karena data spasial dan atribut dapat terintegrasi dengan baik disertai dukungan fungsi-fungsi yang ada di dalam aplikasi dapat bekerja dengan baik.', '1. Sistem informasi geografis dapat diterapkan di\nberbagai bidang salah satunya untuk pendataan\nsistem informasi pedagang dan pasar. Dengan\ndikembangkannya sistem informasi geografis\nlebih lanjut, maka dapat membantu penataan dan\npendataan pasar tradisional yang lebih bagus\nsehingga pasar-pasar tradisional tidak kalah\ndengan pasar-pasar moderen.\n2. DotSpatial mampu digunakan untuk membantu\npembuatan aplikasi informasi geospasial dengan\nbaik, dan terus berkembang sehingga kontrolkontrol penunjang pengolahan data spasial yang\nbelum ada bisa di dapat di versi terbarunya.\n3. Perkembangan sistem informasi geografis sangat\ndiperlukan mengingat masih banyaknya\nmasyarakat umum yang belum begitu mengenal\napa itu sistem informasi geografis termasuk\npengolahan dan kegunaannya.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22775/20825', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(526, 'Fajriah Lita Pamungkasari', '21110114120046', 'Analisis Konfigurasi Optimum Kerangka GCP untuk Survei Pemetaan Luasan Besar Menggunakan Unmanned Aerial Vehicle (UAV)', 'Abdi Sukmono, ST., MT', 'Andri Suprayogi, ST., MT', 'Kota Yogyakarta', '34.71', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22580/20694', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(527, 'Yonanda Simarsoit', '21110114140102', 'Analisis Korelasi Perkembangan Kota Semarang Terhadap Perubahan Penggunaan Air Tanah', 'Dr. Yudo Prasetyo, ST., MT', 'Andri Suprayogi, ST., MT', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2019, '1. Citra Landsat Kota Semarang 2014-2018\n2. Data Air Tanah Kota Semarang 2014-2018\n3. Data Jumlah Penduduk Kota Semarang 2014 - 2018\n4 Data vektor administrasi Kota Semarang 2011\n5 Peta CAT SemarangDemak 2018', 'Klasifikasi Supervised\nIDW\nOverlay\n', 'Luas Tutupan Lahan Tahun 2018\n1. Permukiman = 9.235 Ha\n2. Industri = 1.492,16 Ha\n3. Non Permukiman, Non Industri = 28.358,72 Ha\n\nLuasan hasil klasifikasi citra dari\ntahun 2014 hingga tahun 2018. Untuk daerah\npermukiman mengalami peningkatan dari segi luasan,\nsedangkan daerah industri mengalami kenaikan dan\npenurunan.\n\nLuas Wilayah Penurunan Air Tanah\nRendah = 33.487,235 Ha dengan persentase 85,68 %\nSedang  = 5.052,877 Ha dengan persentase 0,22 %\nTinggi  = 459,364 Ha dengan persentase 12,93 %\nSangat Tinggi = 86,400 Ha dengan persentase 1,18 %\n\n', '1. Perkembangan Kota Semarang mengikuti pola\nmemanjang (linear pattern). Pola perkembangan\nyang dilihat dari pertumbuhan kawasan\npermukiman dan industri. Pola memanjang\nmengikuti jalur transportasi dan mengalami\npertumbuhan paling cepat disepanjang jalur\ntransportasi.\n2. Kedalaman air tanah dangkal mengalami penurunan\nterendah sebesar -0,0108861 m dan yang tertinggi\nadalah -3,67462 m. Perubahan air tanah dalam dari\ntahun 2014 sampai 2018 tiap tahunnya sama, karena\ndata yang diolah pada penelitian ini hanya ada dari\ndua tahun pengamatan. Kedalaman air tanah dalam\ndidapat dari tujuh stasiun pengamatan dengan muka\nair tanah terendah -37,054 m dan tertinggi -1,6183\nm.\n3. Hasil korelasi perubahan kedalaman air tanah\ndangkal dan permukiman memiliki korelasi sangat\ntinggi dari tahun 2014 hingga 2018 dengan\npersentase korelasi tinggi dan sangat tinggi selalu\ndiatas 50%. Pada tahun 2014 ke tahun 2015 korelasi\nair tanah dangkal dengan permukiman sebesar\n65,92% untuk korelasi sangat tinggi dan 21,20%\nuntuk korelasi tinggi, tahun 2015 ke 2016 50,56%\nuntuk korelasi sangat tinggi dan 10,96% untuk\nkorelasi tinggi, tahun 2016 ke 2017 36,89 % untuk\nkorelasi sangat tinggi dan 24,89% untuk korelasi\ntinggi dan tahun 2017 ke 2018 65,23% untuk\nkorelasi sangat tinggi dan 22,11% untuk korelasi\ntinggi. Tingkat korelasi perubahan kedalaman muka\nair tanah dalam dengan kawasan industri memiliki\nkorelasi yang sangat tinggi dengan besar koefisien\nkorelasi sebesar 0,909 dari interval 0 hingga 1\ndengan signifikansi sebesar 0,091.', '1. Pengamatan pola yang lebih akurat dapat dilakukan\ndengan menelaah lebih lanjut hingga ke semua kelas\njalan yang ada.\n2. Klasifikasi penggunaan lahan menggunakan citra\ndengan resolusi yang lebih baik.\n3. Perlunya pengkelasan lebih rinci terhadap daerah\nindustri.\n4. Perlunya data pengamatan kedalaman untuk air\ntanah dangkal yang lebih banyak tiap tahunnya.\n5. Data titik lokasi untuk air tanah dalam yang\nmenyebar merata untuk hasil yang lebih baik lagi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22597/20704', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(528, 'Sintauli Manullang', '21110114120011', 'Analisis Spasial Terhadap Tingkat Kerawanan Banjir Kawasan Sungai Bringin Menggunakan Metode Kombinasi', 'Nurhadi Bashit, ST., M.Eng', 'Bandi Sasmito, ST., MT', 'Kota Semarang', '33.74', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22559/20676', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(529, 'Galuh Puteri Saraswati', '21110114120037', 'Analisis Estimasi Energi Panas Bumi dan Rekomendasi Lokasi Pembangkit Listrik Tenaga Panas Bumi Menggunakan Citra Landsat 8 (Studi Kasus: Kawasan Gunung Ungaran, Jawa Tengah)', 'Dr. Yudo Prasetyo, ST., MT', 'Abdi Sukmono, ST., MT', 'Kab. Semarang', '33.22', 'Fotri Inderaja', 2019, '1. Citra satelit Landsat 8 tahun 2017\n2. DEMNAS\n3. Data suhu harian bulan Agustus 2017\n4. Peta RBI hasil unduhan dari BIG\n5. Data potensi panas bumi\n6. Peta zonasi prospek panas bumi wilayah gedongsongo tahun 2006', 'metode Boolean Integration Model\nMetode AHP\nKalibrasi radiometrik metode ToA (Top of\natmosphere)\nMetode overlay\nKlasifikasi supervised\nNDVI\nLST', 'Klasifikasi kerapatan vegetasi\n1 Badan Air = 2,340 Ha\n2 Vegetasi Jarang = 1.080,810 Ha\n3 Vegetasi Cukup Rapat = 8.378,190 Ha\n4 Vegetasi Rapat = 17.479,080 Ha\n5 Vegetasi Sangat Rapat = 2.758,860 Ha\n\nHasil estimasi energi merupakan area potensial panas bumi di Gedongsongo yaitu pada Desa Kenteng dan Desa Candi dengan luas area 182,585312 Ha dan hasil perhitungan energi sebesar 81,604 MW. Pada area non thermal pada lereng gunung Ungaran pada lintang yang sama dari area potensial. Nilai estimasi energi panas bumi didapatkan dari pengurangan total estimasi energi dari area potensial dengan area non thermal sehingga didapatkan energi sebesar 25,059 MW.\n\nHasil overlay parameter didapatkan lokasi yang sesuai untuk dibangun PLTP sebesar 44,476 km2 dan area yang tidak sesuai sebesar 252,587 km2. Area yang sesuai dengan pembangunan PLTP di sebelah selatan dan timur dari Gunung Ungaran dikarenakan kemiringan lahan yang tidak terlalu curam yaitu kurang dari 15%. Pada penelitian ini, hanya mata air panas Diwak yang terdapat kesesuaian lahan untuk pembangunan PLTP sebanyak 7 lokasi. Lokasi tersebut berada pada Kecamatan Bergas Desa Diwak, Desa Karangjati dan Desa Ngempon ', '1. Berdasarkan metode penentuan area potensial\npanas bumi yang telah dibuat, area potensial WKP\npanas bumi Ungaran berada di cagar budaya Candi\nGedongsongo yaitu Desa Kenteng dan Desa Candi\ndengan luas area 182,585 Ha.\n2. Hasil perhitungan estimasi energi panas bumi\nmenggunakan algoritma Radiative Heat Flux pada\narea potensial panas bumi didapatkan total nilai\nestimasi energi panas bumi di area potensial panas\nbumi Gedongsongo sebesar 25,059 MW.\n3. Didapatkan area yang sesuai untuk rekomendasi\nlokasi pembangunan PLTP sebesar 44,476 km2\ndan area yang tidak sesuai sebesar 252,587 km2\nserta didapatkan 3 site di dekat mata air panas\nDiwak yaitu pada Desa Diwak, Desa Karangjati\ndan Desa Ngempon.\n', '1. Sebaiknya menggunakan citra SAR yang memilki\nSebaiknya dihindari pemakaian citra Landsat 8\npada daerah penelitian yang memiliki liputan\nawan yang tinggi (>10%) karena keterbatasan\nsensor optis.\n2. Sebaiknya dilakukan validasi suhu LST\nmenggunakan suhu pengukuran langsung\ndilapangan pada tahun, musim, bulan yang sama\npada saat perekaman citra, dan pada satu titik\nsampel dilakukan pengukuran yang lebih atau satu\npengukuran dengan memilih area yang homogen.\n3. Penggunakan data suhu dari BMKG sebagai\nambient temperatur atau suhu ruangan harus\nmemperhatikan lokasi yang dekat dengan studi\nkasus, tetapi alangkah lebih baik jika penggunaan\nsuhu ruangan menggunakan data pengukuran suhu\nkedalaman lokasi penelitian.\n4. Sebaiknya dalam penentuan area potensial dan\nestimasi energi panas bumi menggunakan data\ngeologi, geofisika dan geokimia agar penelitian\nlebih akurat.\n5. Sebaiknya rekomendasi lokasi pembangunan\nPLTP selanjutnya dapat mempertimbangkan dari\naspek lainnya seperti aspek sosial-ekonomi\ndaeraah sekitar dan pelaksanaannya sesuai dengan\nUU yang berlaku.\n6. Sebaiknya pada penentuan lokasi PLTP\nmenggunakan data dengan skala yang besar\nsehingga didapatkan hasil yang lebih teliti.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22554/20671', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(530, 'Putri Ardianti Kinasih', '21110114120008', 'Analisis Faktor Aksesibilitas Terhadap Zona Nilai Tanah di Kawasan Pusat Kota untuk Meningkatkan Potensi PAD (Pendapatan Asli Daerah) (Studi Kasus : Kecamatan Kendal, Kabupaten Kendal)', 'Sawitri Subiyanto, Ir., M.Si.', 'Ir. Bambang Sudarsono, MS', 'Kab. Kendal', '33.24', 'Pertanahan Kewilayahan', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22476/20607', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(531, 'Rizky Arga Himawan', '21110113130071', 'Analisis Karakteristik Segmen Batas Administrasi Desa Secara Kartometrik (Studi Kasus : Kabupaten Demak, Kabupaten Semarang)', 'Ir. Sawitri Subiyanto, M.Si', 'Hana Sugiastu Firdaus, ST., MT', 'Kab. Semarang', '33.22', 'Terestris Hidro', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22778/20828', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(532, 'Adri Panjaitan', '21110114120003', 'Analisis Kesesuaian Penggunaan Lahan Terhadap Rencana Tata Ruang Wilayah (RTRW) di Kabupaten Cianjur Menggunakan Sistem Informasi Geografis', 'Ir. Bambang Sudarsono, MS', 'Nurhadi Bashit, ST., M.Eng', 'Kab. Cianjur', '32.03', 'Pertanahan Kewilayahan', 2019, '1. Citra SPOT 7 tahun 2017 (Sumber : Kementerian Lingkungan Hidup dan Kehutanan). \n2. Citra IKONOS tahun 2011 (Sumber : Kementerian Lingkungan Hidup dan Kehutanan). \n3. Peta Batas Administrasi Kabupaten Cianjur Tahun 2017 (Sumber: BAPPEDA Kabupaten Cianjur). \n4. Peta Rencana  Tata Ruang Wilayah (RTRW) Tahun 2011-2031 (Sumber : BAPPEDA Kabupaten Cianjur). \n5. Data survei di lapangan berdasarkan koordinat yang telah ditentukan untuk validasi hasil pengolahan tahun 2018', 'Digitasi on screen dan overlay', 'Hutan Konservasi merupakan klasifikasi penggunaan lahan pada tahun 2011 yang paling sesuai dengan RTRW Cianjur Tahun 2011-2031 yaitu sebesar 3.355,639 ha atau 83,584%. Industri merupakan klasifikasi penggunaan lahan pada tahun 2011 yang  paling tidak sesuai dengan RTRW Cianjur 2011-2031 yaitu sebesar 0% dimana pada wilayah penelitian ini tidak diperuntukkan untuk sarana industri sehingga terjadi pelanggaran penggunaan lahan. Total penggunaan lahan tahun 2011 yang sudah sesuai dengan RTRW Cianjur Tahun 2011-2031 adalah sebesar 18.886,975 ha atau 47,06%. \nHutan Produksi merupakan klasifikasi penggunaan lahan pada tahun 2017 yang paling sesuai dengan RTRW Cianjur Tahun 2011-2031 yaitu sebesar 3.598,78 ha atau 86,56%. Industri merupakan klasifikasi penggunaan lahan pada tahun 2017 yang paling tidak sesuai dengan RTRW Cianjur 2011-2031 yaitu sebesar 151.404 ha atau 0%. Total penggunaan lahan tahun 2017 yang sudah sesuai dengan RTRW Cianjur Tahun 2011-2031 adalah sebesar 19.183,538 ha atau 47,81%.  Selama 6 tahun yaitu dari tahun 2011 ke tahun 2017, terdapat perubahan penggunaan lahan yang terjadi di wilayah penelitian. Jika dilihat dari grafik dan persentase, kesesuaian penggunaan lahan mengalami peningkatan yaitu seluas 303,437 ha atau 0,76%', '1. Penggunaan lahan pada wilayah penelitian  dengan total luas 40.123,4 ha. Perubahan penggunaan lahan tahun 2011 hingga 2017 didapatkan hasil berupa peningkatan dan penurunan luas penggunaan lahan. Luas lahan yang bertambah yaitu hutan konservasi sebesar 14,332 ha (0,04%), hutan produksi sebesar 840,813 ha (2,1%), permukiman pedesaan sebesar 605,858 ha (1,51%), permukiman perkotaan sebesar 172,969 ha  (0,43%) dan  industri sebesar 7,592 ha (0,02%), sedangkan luas lahan yang berkurang yaitu perairan sebesar 4,376 ha (0,01%), perkebunan/tanaman tahunan sebesar 14,582 ha (0,04%), pertanian lahan kering sebesar 1.394,808 ha (3,38%), pertanian lahan basah sebesar 200,4 ha (0,50%) dan sempadan sungai dan danau sebesar 27,399 ha (0,07%).  \n2. Kesesuaian penggunaan lahan terhadap Rencana Tata Ruang/Wilayah (RTRW) Kabupaten Cianjur Tahun 2011-2031 pada tahun 2011 sebesar 18.886,975 ha atau 47,072 % sedangkan pada tahun 2017 sebesar 19.183,538 ha atau 47,81 % dari total luas wilayah penelitian, sehingga kesesuaian Penggunaan lahan wilayah penelitian mengalami peningkatan dalam rentang waktu 6 tahun sebesar 296,563 ha atau 0,739 %. \n ', '1. Citra satelit yang digunakan sebaiknya citra yang memiliki resolusi spasial yang sama sehingga interpretasi antar citra lebih mudah. \n2. Data yang diperlukan dalam penelitian perlu dipersiapkan dengan baik dan memastikan ketersediaan data kepada instansi terkait sehingga proses berlangsungnya penelitian lebih mudah, baik dan lancar. \n3. Perlu dilakukan menggunakan metode pengklasifikasian secara otomatis untuk mempercepat hasil klasifikasi dengan tingkat akurasi yang tinggi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22578/20692', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
