(540, 'Alfi Dian Ranu Wijaya', '21110114130083', 'Studi Perbandingan Metode ARVI, EVI 2 dan NDVI untuk Penentuan Kerapatan Tajuk dalam Identifikasi Lahan Kritis di Kabupaten Boyolali (Studi Kasus: Kec. Ampel, Kec. Cepogo, Kec. Musuk, Kec Selo Kabupaten Boyolali)', 'Ir. Hani?ah, M.Si', 'Nurhadi Bashit, ST., M.Eng', 'Kab. Boyolali', '33.74', 'Fotri Inderaja', 2019, '', '', '', '', '', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22598/20705', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(541, 'Victor Andreas Tarigan', '21110114120005', 'Kajian Akurasi Penentuan Garis Pantai Menggunakan Citra Landsat 8 (Studi Kasus Kabupaten Lampung Timur)', 'Bandi Sasmito, ST., MT', 'Ir. Hani?ah, M.Si', 'Kab. Lampung Timur', '18.07', 'Fotri Inderaja', 2019, '1. Data Pengukuran Pasut\nData pengukuran pasut yang ada pada stasiun pasut\nKambas yang berada di Kabupaten Lampung\nTimur. Data ini diperoleh dari PT. GEOINFORMATIKA SOLUSINDO.\n2. Data Pengukuran Terestris\nData pengukuran terestris sepanjang pesisir pantai\nKabupaten Lampung Timur.\n3. 3. Data Citra Landsat 8', 'BILKO, AGSO dan Tresholding\n', 'Nilai Form-zahl yang didapat sebesar 2,3337 yang\nmenunjukkan tipe pasut pada daerah penelitian adalah\ncampuran tunggal. \nNilai MSL = 1,754363 m. LAT = 1,299298 m. HAT = 2,209428 m\n\nHasil dan Analisis Pengolahan Citra Landsat 8\ndengan Mengaplikasikan Rumus BILKO Penampakan visual citra hasil pengolahan adalah daratan tampak lebih gelap (abu-abu) dibanding lautan yang tampak lebih terang (putih).\n\nHasil dan Analisis Pengolahan Citra Landsat 8 dengan Mengaplikasikan Rumus AGSO\nPenampakan visual citra hasil pengolahan adalah daratan tampak lebih gelap (hitam) dibanding lautan yang tampak lebih terang (abu-abu). \n\nHasil dan Analisis Pengolahan Citra Landsat 8 dengan Thresholding\nPenampakan visual citra hasil pengolahan adalah daratan tampak lebih terang (putih) dibanding lautan yang tampak lebih gelap (hitam).\n\nHasil dan Analisis Garis Pantai Pengolahan\nCitra Landsat 8\nGaris pantai yang didapat dari hasil pengolahan\ncitra Landsat dengan mengaplikasikan rumus BILKO,\nAGSO dan Thresholding adalah garis pantai dari hasil\ndigitasi secara manual pada skala 1 : 25.000. Garis pantai yang di dapatkan adalah garis pantai dengan pasang surut sesaat. Tinggi pasang surut garis pantai tersebut diketahui dari penyesuaian antara waktu perekaman dan prediksi pasang surut saat perekaman citra.', '1. Penentuan garis pantai dengan mengaplikasikan\nrumus BILKO, AGSO dan Thresholding melalui\nbeberapa tahap sebagai berikut: Citra yang\ndigunakan harus melalui proses koreksi radiometrik\ndan proses koreksi. Pengalikasian rumus BILKO\ndan Thresholding menggunakan software ENVI 5.1,\nsedangkan pengalikasian rumus AGSO\nmenggunakan software ERmapper 7.1. Kemudian\ncitra hasil pengaplikasian rumus BILKO, AGSO\ndan Thresholding didigitasi dengan software Arcgis\n10.3.1. Penentuan garis pantai dengan mengunakan\ndata terestris melalui beberapa tahap sebagai\nberikut: proses konversi data tinggi ke data\nkedalaman dengan dengan titik nol yang digunakan\nadalah Lowest Astronomical Tide (LAT), proses\ninterpolasi dengan metode natural neighbor, proses\npembentukan kontur dengan nilai + 0.611 untuk\nperekaman citra pada 27 agustus 2017 dan + 0.668\nuntuk perekaman citra pada 12 september 2016.\n2. Nilai CE90 menunjukkan tingkat akurasi ketelitian\nhorizontal sesuai dengan PERKA BIG No.15 Tahun\n2014. Penentuan garis pantai dengan\nmengaplikasikan rumus BILKO menghasilkan nilai\nCE90 sebesar 27.71178 m dan 28.20878 m.\nPenentuan garis pantai dengan mengaplikasikan\nrumus AGSO menghasilkan nilai CE90 sebesar\n28.40713 m dan 29.55543 m. Penentuan garis pantai\ndengan metode Thresholding menghasilkan nilai\nCE90 sebesar 22.48074 m dan 23.79915 m,\nsehingga ketiga metode tersebut masuk kedalam\nkelas 2 pada skala 1 : 100.000. Nilai CE90 dari\nmetode Thresholding lebih kecil dari dua metode\nlainnya, sehingga metode tersebut yang paling baik\ndigunakan untuk pada daerah Kabupaten Lampung\nTimur penentuan garis pantai adalah metode\nThresholding.', '1. Citra yang digunakan untuk pengaplikasian rumus\nBILKO, AGSO dan Thresholding sebaiknya citra\nyang tidak berawan.\n2. Pada proses koreksi geometrik citra satelit dengan\nsoftware ENVI 5.1 sebaikknya menggunakan\nKomputer atau laptop dengan spesifikasi yang\ntinggi.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22592/20700', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
