(547, 'Khoirul Isnaini Aulia', '21110114140056', 'Analisis Arah Perkembangan Fisik Wilayah Kabupaten Kendal Menggunakan Sistem Informasi Geografis', 'Sawitri Subiyanto, Ir., M.Si.', 'Ir. Bambang Sudarsono, MS', 'Kab. Kendal', '33.24', 'Pertanahan Kewilayahan', 2019, '1. Data primer yang digunakan dalam penelitian ini meliputi citra Landsat 7 tahun 2007 dan 2012 citra Landsat 8 tahun 2018.  \n2. Data sekunder yang digunakan dalam penelitian ini meliputi Citra Worldview Kabupaten Kendal Tahun 2016 dari Dinas Pekerjaan Umum dan Penataan Ruang,  Batas Administrasi dan Peta RTRW Kabupaten Kendal tahun 2016 dari Bappeda Kabupaten Kendal, dan Data Kependudukan Kabupaten Kendal tahun 2017 dari BPS Kabupaten Kendal. ', 'Metode SIG  meliputi digitasi on screen, overlay, Analisis Tetangga Terdekat atau Global Moran?s Indeks, Analisis Rank Size Rule ', ' Arah perkembangan fisik wilayah yang mengarah ke sebelah timur Kabupaten Kendal yang berada pada Kecamatan Boja, sehingga menyebabkan alih fungsi lahan permukiman.', '1. Pola pekembangan wilayah di Kabupaten Kendal menurut persebaran permukiman tiap kecamatan pada tahun 2007, 2012 dan 2018 pola yang terbentuk yaitu pola Tersebar dan pola Acak. Disebut wilayah berkembang pada penelitian terdahulu jika pada kecamatan di kabupaten ini mengalami perubahan pola yang berbeda pada tahun 2007/2012/2018. Hasil dari analisis Global Moran?s I untuk mengetahui pola perkembangan permukiman apakah berkembang atau tidak berkembang. Wilayah yang berkembang pada pola perkembangan permukiman yaitu Kecamatan Boja, Kecamatan Singorojo dan Kecamatan Brangsong. \n2. Arah Perkembangan wilayah di Kabupaten Kendal pada penggunaan lahan tahun 2007-2012 dan pada penggunaan lahan tahun 2012-2018. Pada hasil arah perkembangan ini melihat penggunaan lahan permukiman, dan industri. Penggunaan lahan pada tahun 2007-2012 arah perkembangan fisik wilayah yang mengarah ke sebelah Timur Kabupaten Kendal yaitu Kecamatan Boja. Dan penggunaan lahan pada tahun 2012-2018 arah perkembangan fisik wilayah yang mengarah ke sebelah Timur Kabupaten Kendal yaitu Kecamatan Boja.', '1. Dalam penggunaan data citra satelit sebagai dasar klasifikasi penggunaan lahan, sebaiknya menggunakan citra satelit resolusi tinggi agar lebih mudah dalam penklasifikasian kelas penggunaan lahan. \n2. Dalam penggunaan data temporal citra satelit untuk penelitian perkembangan suatu wilayah menggunakan temporal yang tinggi agar memudahkan dalam mengetahui proses perkembangannya. ', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/22779/20829', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
