(554, 'Brinton Patuan Sitorus', '21110114130082', 'Analisis Perkembangan Penggunaan dan Pemanfaatan Tanah (P2T) Berbasis Bidang Menggunakan Sistem Informasi Geografis', 'Moehammad Awaluddin, S.T., M.T', 'Arief Laila Nugraha, S.T., M.Eng', 'Kota Semarang', '33.74', 'Karto SIG', 2019, '1.) Kuisioner, survey, langsung.\n2.) Citra Worldview tahun 2016', 'Interpretasi digitasi on screen\n', '1. Persebaran penggunaan tanah tahun 2011 dan\n2018 didominasi oleh kelas perumahan\nsedangkan persebaran pemanfaatan tanah\ntahun 2011 dan 2018 adalah Pemanfaatan\nTempat Tinggal.\n2. Arah perkembangan paling meningkat dari\npenggunaan tanah terdapat pada kelas jasa\nperdagangan yaitu sebesar 4,11 % sedangkan\nyang mengalami penurunan terdapat pada\nkelas perumahan dimana kelas perumahan\nmengalami penurunan sebesar 6,8%. Arah\nperkembangan paling meningkat dari\npemanfaatan tanah terdapat pada kelas\npemanfaatan sarana perdagangan yaitu\nsebesar 4,17 % sedangkan yang paling\nmengalami penurunan terdapat pada kelas\ntidak ada pemanfaatan yaitu sebesar 7,36%', '1. Persebaran penggunaan tanah tahun 2011 dan\n2018 didominasi oleh kelas perumahan\nsedangkan persebaran pemanfaatan tanah\ntahun 2011 dan 2018 adalah Pemanfaatan\nTempat Tinggal.\n2. Arah perkembangan paling meningkat dari\npenggunaan tanah terdapat pada kelas jasa\nperdagangan yaitu sebesar 4,11 % sedangkan\nyang mengalami penurunan terdapat pada\nkelas perumahan dimana kelas perumahan\nmengalami penurunan sebesar 6,8%. Arah\nperkembangan paling meningkat dari\npemanfaatan tanah terdapat pada kelas\npemanfaatan sarana perdagangan yaitu\nsebesar 4,17 % sedangkan yang paling\nmengalami penurunan terdapat pada kelas\ntidak ada pemanfaatan yaitu sebesar 7,36%', '`1. Dikarenakan penelitian kali ini bersifat time\nseries maka sebaiknya mendapatkan citra\nyang sesuai dengan tahun penelitian\n2. Sebaiknya mendapat data persil yang lengkap\ndari instansi yang memiliki data tersebut\nseperti : IBN, RDTR dll.\n3. Menambahkan personil lebih agar saat\nmelakukan survei menjadi lebih cepat dan\nefektif.\n4. Membuat database yang menghubungkan\ntitik survei dan foto.', 'https://ejournal3.undip.ac.id/index.php/geodesi/article/view/23730/21598', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
